INSERT INTO `buzzs` VALUES (1,'Word up bro! Wild Story!','Yo! Good to hear from ya, been a while.  Sounds like Alaska is treating you well.  Getting cold up there these days?  Great shots, that looks like a damn big moose!  Anywho hope all is well.  Quick question, what type of file did you upload?  I seem to have a glich or something cause the photos on the story page are falling off the screen..Do you know what might be the cause? If you don\'t mind let me know so i can get it fixed. Well, Cheers! I\'ll let u know if i make it the Alaska way, eh! Keep in touch',2,17,1,NULL,NULL,'2012-10-14 22:57:19','2012-10-14 22:57:19'),(2,'I want to see a photo!','Yeah!',2,151,2,NULL,NULL,'2012-11-27 05:31:31','2012-11-27 05:31:31'),(3,'Facebook?','what\'s the story?',2,152,3,NULL,NULL,'2012-12-04 22:48:44','2012-12-04 22:48:44'),(4,'check this','for testing',155,17,4,NULL,NULL,'2013-02-26 05:47:24','2013-02-26 05:47:24'),(5,'hi','hello',155,14,5,NULL,NULL,'2014-03-03 07:44:55','2014-03-03 07:44:55'),(6,'hi','hello',155,14,6,NULL,NULL,'2014-03-03 07:45:26','2014-03-03 07:45:26'),(7,'working','working',155,14,7,NULL,NULL,'2014-03-03 07:52:11','2014-03-03 07:52:11'),(8,'working','working',155,14,8,NULL,NULL,'2014-03-03 07:52:56','2014-03-03 07:52:57');
