INSERT INTO `stories` VALUES (2,9,'Poor Farm 2009','poor_farm_2009','leisure','25','M',0,2009,'Manawa, WI',NULL,0,0,1,'2010-08-22 22:17:21','2011-12-21 20:25:27','2011-03-11 17:04:50','<img src=\'http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/3/large/11133_517906664552_82101152_30860658_6206163_n.jpg?1282493842\' style=\'float:left;\' /><p>During the fall of 2009 I did an unofficial Artist Residency at the Poor Farm in Manawa, WI. I will get into stories of how I spent my days Painting, enjoying craft beers and Fishing. There is nothing like making progress in your art, catching your own dinner eating it as soon as the fire has made it nice and crispy around the tail. This story is the complete opposite of these fabulous days of solitude. It was a Sunday or Monday Night football game and I went to the local tavern/bowling alley to enjoy the Packers with the people. I was a few beers deep when I started talking with everybody. My night got a lot crazier and to this day don\'t really know how I got home having to pick up the truck by bike in the morning nearly two miles away. I was bullshitting and yelling about how bad the Packers suck. Being a Bears fan the locals knowing I was from Chicago instantly. This is when I started gambling with Five gentlemen on dice, the game and whatever else we could put a dollar on. It just ended up we weren\'t betting money we were betting shots. I won about twenty bets and took every shot. Looking back I now realize these locals were using me as there entertainment and trying to get me as drunk as possible. It wasn\'t til and old man who didn\'t work there took me out and dropped me in the lot. I didn\'t frequent this bar much more but did just go back there a few weeks ago During the second Great Poor Farm Experiment. </p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,10,'When life gives you lemons, something something...Prostitutes, drugs, and tamales','when_life_gives_you_lemons_something_somethingprostitutes_drugs_and_tamales','','23','Male',0,2008,'Barcelona, Spain',NULL,0,0,0,'2010-09-07 01:20:10','2013-07-02 13:54:15',NULL,'<p>There I was, once again, sitting like an egg in a twenty-two baker?s dozen carton. This particular one just happened to have wings and engines. They like to call it an airplane. It\'s something that shows you have money to travel somewhere quickly and with class. I prefer to name it in light of the truth: a prepaid experience of discomfort, crying babies, large snoring men, and a tray with assorted shades of disgusting they expect you to inject into your mouth. I suppose I shouldn\'t be so negative...human flight is an incredible thing.\r\n\r\nAll the same, I no longer enjoy flying. After the first trip the excitement was gone and replaced with the realization that everyone cares only about their own comfort. Each time I got to my seat I counted down the minutes before Johnny Recliner sat in front of me thinking he?s on a roller coaster. He went straight up out of the first dive slamming the chair back, and shot my kneecap into my thigh. All this and the egg carton hasn?t even taxied from the gate yet.\r\n\r\nI was flying from Chicago to Prague to meet friends studying abroad. My connections were Madrid and Barcelona. I missed my flight in Barcelona. My luggage, however, did not. Next flight to Prague was 24 hours later, and all I had was my passport, some Czech crowns, and a credit card. The airline refused to pay for a hotel, so I decided not to get one, and caught a bus into the city.\r\n\r\nIt was about 4PM on a 70 degree, sunny mid-October day. I roamed around side streets to the Mediterranean and back to town square, bought fruit I\'d never seen and watched the street performers mime out their day jobs. Soon enough it was getting dark and chilly so I found myself in a pub.\r\n\r\nMidnight and a few drinks later I decided to roam the streets again. As I walked out a girl got up off a nearby curb and walked imploringly towards me. She was dressed in the latest fads as most women there are with fitted, sophisticated clothes; expensive and uncomfortable looking shoes, hair done like she was going to prom, etc. If only the sun were out to catch her lovely olive skin. It took me a second to realize she was asking if I had a light by the way she was twitching her fingers in mock ignition. After talking a bit she and her friend invited me to a \'drum n\' bass\' party a few subway stops away. I wasn\'t doing anything better so I said I\'d meet them there.\r\n\r\nThis discotheque was one of the most vile, run down, biohazard-type places I\'ve ever set my senses upon. I could feel the bacteria running up my nose making me gag. I paid the cover and went into the main room. Everyone was smoking and putting out the butts on the floor, which was very sticky from all the spilled drinks. I grabbed a beer myself and started dancing to the beat of the spinners on stage with my new friends. 2AM and jet lag caught up to me and I had to say goodbye. After the traditional cheek kisses I made my way back to the subway.\r\n\r\nI had a good grasp on the side streets and was going back to town square to find a bench to sleep on. After buying a liter of water I went down an alley and a woman from an even smaller alley popped out from the right as I walked past, grabed my left wrist, spun me around, looked me right in the eye and said, \"I\'ll suck your cock, man.\"\r\n\r\nI replied, \"Uh, no, thanks, I\'m good actually. Was just headed back to the town center.\"\r\n\r\nShe wouldn\'t let go so I figured just keep talking and declining until she let go. Poor choice. As I kept declining her advances five other prostitutes and their pimp had meandered out of their little hovel alleyway and surrounded me. It was too late as I realized this and they were on me. Two of them pulled my pants down as the other three were working my upper body to pick me up while their pimp and the first hooker supervised and taunted. \r\n\r\nI maintained composure figuring I\'d get out of this easily enough. Then I started losing ground while they dragged me toward that alley. That\'s when I lost it and started throwing fists and elbows. I hit one in the chest and another the arm. A little more struggle and I finally broke free of the circle, hiked up my pants, checked for my passport, and started walking away and looking back to ensure no pursuit was made. The first thing I remember thinking was how pissed I was that they made me drop the water bottle I\'d just bought and barely got a sip of it.\r\n\r\nI pushed on toward the square passing some twenty more prostitutes offering me sex and another fifteen guys offering any drug I could think of. Then there were about three men I passed with baskets in their arms selling what looked like tamales. They looked delicious, but I figured any food product sold in an open basket at 3AM in the streets of Spain was probably not a good idea. So I walked on.\r\n\r\nI bench hopped talking to random people. They kept waking me up when I\'d nod off warning me that if I slept I would get beaten and robbed. I took a walk to stay alert. On this walk at about 6AM is when I met Barry and his brother, two Irishmen vacationing with their family for their grandmother\'s 80th birthday. They were on their way back from a night of drinking, and were rather drunk. They asked for a lighter and we started talking. They found out I missed my flight and didn\'t have a place to stay and simply said, \"No, you\'re coming with us.\"\r\n\r\nThey stumbled back to their hotel, which just so happened to be five-star, and let me up to have a beer from the hotel bar (they said it\'s all on their parent\'s tab anyhow), and Barry slept on two chairs giving me his bed to sleep in until my flight came up. Around noon I woke up and he walked me down to the lobby before meeting his family for lunch. We exchanged numbers in the event that we ever travel in the other\'s country and need a place to stay. Finally I made my way to Prague.\r\n\r\nBack in another egg carton I realized I had no way of meeting my friends. I had no way to contact them. For all they knew I was dead because I had told them I would meet them at a landmark in Prague 24 hours earlier and never showed. So when I arrived around 8PM I started walking around the major tourist areas thinking I might happen to run into them. Chances were very slim, but might as well try. After ten minutes of this I gave up, set down my pack and called some other people I knew in Prague to see if they wanted to meet for coffee. No more than five minutes after hanging up with them, my friends studying abroad walked right past me. I called out to them, but they were used to getting cat calls studying in Spain and ignored me. I ran after them and after realizing it was me, I just about got tackled. None of us could believe how things had worked out.\r\n\r\nI suppose that\'s what I came away with. When life gives you lemons, it could turn into way more than just lemonade. So don\'t expect life to simply hand you a glass. Just know that in the end, everything seems to work out. I used to think it was something I was doing, but I\'m starting to realize more and more that it is God teaching me I am not really in control.\r\n\r\nCurveball...</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,14,'the come back 1','the_come_back_1','sanctuary','20','male',0,2010,'Yaounde',NULL,1,0,1,'2010-09-15 23:25:31','2011-12-21 20:25:28',NULL,'<p>I went back to the town i left a few months before and it seems like everything is exactly the same. But why am i so unhappy? Inside myself i\'m feeling so sad and i\'m glad to leave again...</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,14,'a special saturday','a_special_saturday','Mr S.','XX','male',0,2010,'douala,Cameroon',NULL,0,0,1,'2010-09-27 22:30:24','2011-12-21 20:25:28',NULL,'<p>Before talking about this Saturday i found very very long let me tell you that my Saturdays were generally leaving my bed at 1 pm, taking a rapid bath, feeding myself like an animal and then beginning a long sweet night. But that famous Saturday i decided to take a look at what happening in the outside world in other let myself be in touch in different changes that where able to occur. So i went and began to wonder in the city; there was no changes that can be noticed (excuse me \"that was important to me\"). In my great disappointment i decided to finish my Saturday as usual, but before i had to visit a friend of mine. It was almost 5 pm when i enter her home, and after that i do not remember anything; i do not ever know how things happened. How could it arrive to me??who is spending his life to control the reactions of others?I was not able to control myself and i let the worst happened. we are a saturday like others and i have been unfaithful, and i think it is the worst saturday of my holidays</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,6,'A SUMMER ON THE ROAD, PT. 1','a_summer_on_the_road_pt_1','','Late 20\'s','Male',0,2010,'Southwest',NULL,1,0,1,'2010-10-04 04:32:49','2011-12-21 20:25:29',NULL,'<p>       I went on a journey this summer. It was full of ups and downs, cheap days and expensive ones. And there were days with no cash, just lucky I had the people around that I had. \r\n      \r\n       It began because I had hit a place of complacency, and I had to kick it.  Living in Santa Barbara, CA is a wonderful place to live, and to anybody complaining about where they live being the same shit, day in, day out, I strongly urge you to move here. It may be the same shit day in day out here, but it?s damn hard to complain about the ins and outs! \r\n      \r\n       I am a filmmaker. But that is a tricky word. Filmmakers don?t make money; they make films. It?s cool to make films. I love it. Just the year before I had gone to both Sundance and Santa Barbara?s international film fest with a film I had worked on and even got to experience some of the glamour and glitz! But doing video work, freelance, and trying to stay sane enough in between jobs, while you work on your own tour de force to catch a big break, is only for the thick skinned. Being broke like a college student while you try to make it into the movies is the major prerequisite. If you can?t give ten years of it, don?t try. \r\n	\r\n       So I had made up my mind, or economics had made them up for me, to be more precise. I was broke and needed to hit the road. I know, you?re thinking, ?It costs money to travel.? I guess that?s the beauty of my summer. I hit the road damn near broke and basically came home the same way, damn near broke. But I was also broke were I was consciously. I needed a break from paradise.  \r\n       \r\n       I hit the road to Texas. I had a job with my Dad, for his property management company, (more on that later, I wasn?t doing much managing though). He lives on South Padre Island, down on the southern tip near Mexico. And that?s where I was going. I was gonna make a ton of loot, party like crazy on an island and meet the woman of my dreams! And since I was broke in Santa Barbara, CA, I had no choice but to hit the road broke and shoot for a job. \r\n	\r\n        I had been basically living like a vagabond for quite some time. About nine months actually. I was lucky to have a car to sleep in at least two nights a week, I couch surfed on and off, occupied different rooms around town while friends of mine were off on their own adventures, etc. And I had had enough. I packed up everything I could, but really just the bare minimum. I stored a few things at my brother Jack?s house, and told my friends goodbye. I?ll be back. ?Yeah right,? I could hear each of them thinking. ?He?s gonna get a good job, has options to live in Austin, who knows if we?ll see him again.? I have seen it myself many times. You?re excited to see your friend leave to explore an opportunity or a need, but may never see them again. Usually you never see them again. \r\n      \r\n        Instead of the big, drawn out, ?see yahs,? I prefer just saying bye. That?s is. Wave and walk away. ?Bye!? Hopefully you really do plan on coming back, but when you?re heading out like this, even you yourself can?t know for sure. But I had to go.  See ya. \r\n      \r\n        I stayed at my brother?s house the night before I left, fittingly on the couch. His roommate made me a couple of CD?s for the road, left them on the table for me to find in the morning. I said, ?Goodnight, I?m out at 5, hit you up from the road!?  There wasn?t really too much said about it beyond that. I knew nobody else was going to be up at that time. I am on my own for a while. \r\n      \r\n         I was out at 5 a.m. sharp. The sun hadn?t come up yet, but had begun to light up the morning sky. I went to A.M P.M and fueled up what would be the most expensive tank of gas that I would pour four at least three months. As I was leaving my Brother?s place, I remembered to grab the CD?s, and to my chagrin Kyle had left me Abbey Road. As I pulled out of the gas station Come Together began. And I was off. The sun was coming up as I drove down the coast through Summerland, the morning sun silhouetting the tall palms with a warm glow.  And as if Santa Barbara was already a dream, I was on the road \r\n\r\n\r\n                   To be continued . . . </p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,23,'River Flowing','river_flowing','Nature','','',NULL,NULL,'',NULL,1,1,1,'2010-10-15 04:35:29','2010-10-15 04:35:29',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,23,'BMX','bmx','','','',NULL,NULL,'',NULL,1,1,1,'2010-10-15 05:02:24','2010-10-15 05:06:03',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,23,'BMX at the Mercury Lounge','bmx_at_the_mercury_lounge','','','',NULL,NULL,'Goleta, CA',NULL,0,0,1,'2010-10-15 20:41:10','2010-10-15 20:41:11',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,30,'A true story','a_true_story','','','',0,2010,'Pakistan',NULL,1,1,1,'2010-10-27 12:39:21','2011-12-21 20:25:30','2011-03-11 17:05:04','<p>This is a story of a girl who is now turned into a women and still fighting for her respect and rights.When se was born no one in her family was happy because she was a girl.even on her birth one of her relitive said that they Hate her eyes as er eyes was too big she grow between boys as she had no other girl cousen.years pass she throw on last seats even in her family just because she is the edlest and she was a girl and se is weatish in colour.After doing her intermediate she tries to do her gradution 7 times she do this attempt but fails to even start her studies so she compleat her homoeopathic diploma.then due to her financial crisis she start her job she face lot of problems in her family and on job place.she did tis for about 12 years,in 12th year se got engaged so she had to do job in 2 parts of the day to make her dowry in te first part she do teacing in a college and in second part she do work as receptionist.during this period she learn textile design,ikabana,international cooking,baking,dryflower arrangment,tie and die,glasspainting.but she have no support to do any thing profssionly or to promote her telent.She got married to a man who is not mentally ready to be husband of any one\r\n         after 3 month of marriage she divorced and she come back to her parents home again but se lost all her confidence,respect in the eyes of her family member except her ma,although she also got very humilating attitude even in market,public place,any were she can do her insult.after 8 years she again get a purposal of a man who wants to marry her.this time hher father force her for this marriage.she again got divercoed after 3 month and in her both marriage she dont have any kid,means no aim in er life.Now she is completly shrateerd,no confidence,no nothing,she start again to compleat her study after 18 years her ma again support her in this stage.Her sister and ma took her for umrah(Muslim place for pryaing)and she also took part on in tv show won a huge gift then she tries her luck as radio host but luck never goes with her.\r\n           so she now compleating her education she is not beautiful,nor a rich person,she has no other quality that will make her promenent in others eye.she still wating to be compleating by marriage she is lookin g for good life partner.a house and she wants kids.Se now dont want to marry in Pakistan.she still fight in her family for her place.dont no what will be er future.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,44,'a short story','a_short_story','','','',0,2009,'Manchester, England',NULL,0,0,1,'2010-12-01 17:13:56','2011-12-21 20:25:30',NULL,'<p>Once upon a time..... every story should start this way. immediately people will think its a fantasy, maybe most of life is. Once upon a time A women named Jill who is a scally well she says she is, her exterior is super tough likes to walk, talk and look like a scally but really she is the sweetest most considerate person one will ever meet. One day while getting off the city bus she noticed a young girl about 15 sitting in the bushes near the freeway. This young girl was SCREAMING and crying as loud as she possibly could. Jill curious and concerned crossed the street to see what was wrong with this young girl, no one else getting off the bus or walking on the street even glanced over to where this young girl was screaming, but this scally Jill went over. As she got closer she noticed that this girl was ony wearing a zip up sweater and a pair of jeans..... it was about 36 degrees outside and raining. Anyways it turned out the young girl was left by her boyfriend after a night of partying.... she was freezing and confused in my opinion Jill saved the day! the girl was picked up by the police and taken home. The End.   </p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,44,'a short story','a_short_story_2','','','',0,2010,'yorba linda, california',NULL,0,0,1,'2010-12-06 19:34:01','2011-12-21 20:25:31',NULL,'<p>once upon a time a family threw a tamale party. There were 4 tias 1 tio, 2 abuelos and 3 primos. the party started at 12:00pm but most didnt arrive until 2:00pm. as soon as everyone was there the tamales started to be made. first you soak the tamale leaves the lowest ranked person (one who is not good at making tamales...yet) soaks and seperates the leaves.... very boring. the rest spread the masa on to the leaves and then hand it to the highest ranked person to put on the meat, one olive and chili then wrap the tamale. the highest ranked is usually the one who did most of the work... this person makes all the chili from scratch, very long process. through out this party much was eaten. delicious beans, tamales of course, pizza, salad, tostadas and in order for the tamales to taste extra good margaritas are served! in total about 300 tamales were made. the end.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(14,9,'some vague pictures of great stories','some_vague_pictures_of_great_stories','photography','25','male',0,2010,'western suburbs of chicago',NULL,1,0,1,'2010-12-27 04:01:26','2011-12-21 20:25:31',NULL,'<img src=\'http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/9/large/00240032.JPG?1293397286\' style=\'float:left;\' /><p>sometimes people want me to shoot photos of there event...wedding, concert, party, whatever...it gives me a reason to take pictures when i usually would be grateful to not be shooting photos. I\'m happy when i come away with something decent that describes the day in one shot. These are some leftover shots I enjoy from the western suburbs of chicago.</p><img src=\'http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/10/large/00110017.JPG?1293397289\' style=\'float:left;\' /><p></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,45,'Hold on to me & I will never let go of you','hold_on_to_me_i_will_never_let_go_of_you','Poetry','','Male',0,2011,'Santa Barbara',NULL,0,0,1,'2011-01-19 17:20:36','2011-12-21 20:25:31',NULL,'<img src=\'http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/11/large/WoundedMarine.jpg?1295432437\' style=\'float:left;\' /><p>Hold on to me & I will never let go of you\r\nA picture\'s worth a thousand words and when I saw your picture it struck my nerves,\r\nTo feel the hurt to feel the pain to not know who you were a man without a name, \r\nI wanted to be there to help you to remove the rocks that covered you,\r\nI would be there for you to hold on to me & I would never let you go,\r\nI would be the legs you were missing to get you safely home,\r\nOn our way I would tell you what we were going to do,\r\nWe were going to rebuild both our attitudes b/c what you lost I did too,\r\nYou lost your legs I lost my heart, \r\nYour experience was heartache to see, \r\nHow I have what you don?t and I still hate to be me,\r\nI won?t let you give in,\r\nHold on to me & I will never let go of you,\r\nFor it was you who taught me what I couldn?t teach myself,\r\nThat everyone survives in this world by getting  a little help,\r\nYou don?t know me and I don?t know you,\r\nBut you?re the soldier that represents our red white and blue,\r\nHow can?t I see , you in need,  a soldier with love who has to rebuild their dreams,\r\nIts starts with you and me,\r\nIn  the dark is where we sit and drink, \r\nTell each other the stories of how we are and what we think,\r\nAnd never has it been this way,\r\n finding my heart will be like finding your legs,\r\nAs you can see already you have it fully,\r\nI don?t know you and you don?t know me,\r\nI have to say Thank you so much for helping my heart find its way back to me.\r\nI stared silent as I watched your life change,\r\nI prayed and begged that mine would serve the same, \r\nThat if we come together through the trials we face\r\nYou will know that love rules over all the hurt and hate, \r\nSo find my words today on the bed where you lay that I am here with you I am here to stay,\r\nAs I will never leave you no matter what you do,\r\nHold on to me  & I will never let  go of you,\r\n\r\nDaniel Menna\r\n\r\n\r\n</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,45,'Wishing','wishing','Poetry','','male',0,2011,'Santa Barbara',NULL,0,0,1,'2011-01-19 18:49:50','2011-12-21 20:25:32',NULL,'<img src=\'http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/15/large/trust.jpg?1295437790\' style=\'float:left;\' /><p>\r\n\r\nI\'m a child again wishing again to be Aladdin with a genie simplicity with 3 wishes granted to me,\r\nUsing two for me, then the third for my genie to be free. \r\nWhat would I wish for if I don?t care for material things I don?t want anymore,\r\nI want the perception in this world to change genie grant me my first wish,\r\nThat everyone was not alone in their life?s trip,\r\nGrant them the friend they have on the inside,\r\nPulled out from their light to be a friend on the outside,\r\nWhat can?t hide or be shy to their interaction to them they are their truth\r\nStaring back at them,\r\nWhat would they be the star that helps you burn bright in what you are,\r\nSo here we go again since im a child with 3 wishes wishing again,\r\nMy second wish out of three, \r\nMy other wish will be,\r\nTo keep free will still,\r\nFrom my second wish of opportunity,\r\nIts my guarantee others can get through this hard life if they could just see what I see,\r\nSo grant every person please to have the opportunity to be free,\r\nThis way we all have a chance only thing limiting us is when we say we can?t, \r\nAt least with my wish from my genie we all get a try at the opportunity in life we all need to get by. \r\nThe third wish now on the terms that I agreed I wish for you too,\r\nGenie for the chance to be free. \r\nI was your friend and not your master,\r\nWe conquered hardships with laughter,\r\nThe learning lessons in wishing for freedom of all souls\r\nChildren with there wishes they tend to wish for gold,\r\nWhat I now know is that we all need some help to give our inner wishes a time to get out,\r\nSo wish for things that create a giving cycle,\r\nWith opportunity for others this goes as far as a miracle,\r\nThis love of thoughts is my dance with me in my genies granted wishes through my poetry.   \r\n\r\nBy Daniel Menna\r\n</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,45,'YOU MAKE IT LOOK EASY','you_make_it_look_easy','Poetry','','Male',0,2011,'Santa Barbara',NULL,1,0,1,'2011-01-19 19:17:19','2011-12-21 20:25:32',NULL,'<img src=\'http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/17/large/angel.jpg?1295439515\' style=\'float:left;\' /><p>YOU MAKE IT LOOK EASY. \r\n\r\n\r\nIts effortless in the action you display,\r\nIts emotionally potent the feelings you make with the words you say. \r\nAnd with all your ability to do what you do \r\nI couldn?t save you \r\n\r\n\r\nI envy what you can give through your laugh touch presence and all together existence \r\nMother Teresa must have learned from you in another life when it was just you two.  Walking on a tough road you point up the road that?s were we will all go I will make us a home where your acceptance remains with the love that grows, I will take the life?s that hurt you take away all the pain and give you something special with the home that I gave. A life as a house with no door left shut open to all with Unbreakable passion that?s forever kept within our hearts, indivisible could never be torn apart with the love that gave us our innocents and a great head start. \r\nPaying attention to all that makes you- you not changing your mind kill them with kindness is what you do. Its not on how you please me but the love is like your art and YOU MAKE IT LOOK EASY. \r\n\r\nThe sad mans back from the past he had choices and misfortunes turned his mad feelings to sad. Your only thoughts to give back give him a hug and wrap your arms around his neck. Take the shirt off your back to comfort his life show him with your belief in actions you can make things right. He starts asking questions from watching you through the day how you work all day and at night you pray you come by his bed with the prayers in your head repeating for his forgiveness from what is making him sad. You never left him you stayed right near him its like you decided to bear all this weight for a stranger. I have walked a long road In experience but not in time collected all my thoughts to add up and find you?re my inspiration to what I now believe in my mind\r\nBecause of you I think why not me and possibly I can do what you make look so easy.\r\n\r\n\r\nThe next couple of days it was hard I couldn?t eat and my stomach was starved. I don?t know where this strength is coming from but today im getting up out of bed its time to apply all that?s said and block out the sad that only turned me mad. I have a new shirt on my back a note by my bed eyes watching me an unseen love I feel it I know that its real b/c im on my feet again, seeing that I can make it through. what would I do? without this house that came from you. I Got my heart back a hug around my neck and now its my time to give back I been saving this check that?s breaking my heart b/c its all that I  have it was your prayers to me it was you watching me, it was anything you did through grace, emotions seen, you cured this broken heart with a patient part in restoring my life with the words you said, and the moments you spent praying late night by my bed, I want you to know on my last day, you gave the strength in me to get out of bed, and crawl on the floor, down the hall as I opened your door, I crawled up to you, said the same prayer you do, and felt the power of God something I never knew, When the next day came I had a new belief, the belief in myself with the love you gave me. Thank you, you saved me, the constant prayers that you said with love gave me all I needed,  How do you do what you do when this world gets to you? How do you survive? She replied while passionate tears fell from her eyes she cried ?I do this to survive I was never loved so I now give what I never had when I feel like im going to die rebuild my spirit that I have so I can make others glad to be alive, help them wake up the beauty inside. That?s why im hear everyday with my prayers and my ability to do something for you, and I knew what is was like to be you, b/c at one point it was me and I woke up one morning with that same belief. It came from my angel the one who saved me, they built a house and comforted me when I thought no one could love me. I was wrong b/c they did it effortlessly, ?what you want to be, put your whole heart into it and you will see, even you to can make it look easy. \r\n\r\n\r\nDaniel Menna</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,14,'I\'m already there','im_already_there','','','',0,2011,'YAOUNDE,CM',NULL,0,0,1,'2011-02-20 16:32:38','2011-12-21 20:25:32',NULL,'<p>hi everybody! it\'s been a while i haven\'t there so i think i have to apologize for the time spent out of this site. I can\'t write all the amazing things that happened since I quit; i won\'t have enough place. just to make my come back and i swear i will be more present now. \r\n                                                         greetings</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,78,'the dawn of a new day','the_dawn_of_a_new_day','','','',NULL,NULL,'',NULL,1,0,1,'2011-07-15 08:01:55','2011-07-20 19:35:28',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,91,'Ramadan Bell','ramadan_bell','Religious tolerance','All ages','All',0,1920,'Al Rafeed - Jordan',NULL,1,1,0,'2011-08-27 17:31:34','2011-12-21 20:25:33',NULL,'<p>\r\n\r\nRamadan Bell\r\n\r\nIt’s a story happened before more than 80 years .. were people in villages think and live simply than now.. many of village in Jordan have both communities Christian and Muslim sharing the same land, sky and water.. most of them celebrated each other Holy days and nights\r\nOne of those village were Alrafeed in the south of Jordan \r\nAs all the villagers , people work in land .. and the best days for them is when its raining..\r\nRamadan the month of fast comes on that year in winter.. The Holy days and Ramadan does not come in the same every year at Muslim’s.\r\nIn Muslim culture they used the Hijri year(Islamic year) its belong to  Lunar cycle\r\nIts winter.. and Ramadan, muslim people were fasted.. from the Dawn to dusk\r\nThe Imam of the mosque call them to begin the fast at the dawn and call them again the dusk to stop fasting and take their meal..\r\nAl villagers used to gather at one house after taking their food .. sharing sweets, hot drink and talking about the rain and their agriculture.. \r\nOne night of Ramadan .. the Imam of mosque were sick… he stayed many days and nights at his home can not call people to fast at the dawn or the dusk\r\nIn that night they talk about Imam illness, As the priest in .. and about their suffering of fasting.. because they cant eat until it comes completely night as they can know when the dusk begin as the Quran saying..\r\nSuddenly , an idea comes to one of young villager, he turned to the Priest who used to stay up with his villagers, and asking him: our priest, why don’t you ring the bell of church at dusk as our Imam is sick to stop our fasting ?\r\nEveryone praised the idea.. so the priest said: I will pass by the Imam and reinitiated him if I can do it\r\nNext day the priest visit the Imam to reassure his health.. and telling him the suggestion \r\nThe Imam welcomed the idea and thanked the priest if he can ring the bell for the villagers, as it was so cold and he still sick\r\nfor many days until regained its health, people in Alrafeed stop their fasting when they heared the church bell ring..\r\nThis Bell is still ringing above the Church, not in Alrafeed. But here in Amman, tells people Muslim and Christian his story with people in that far village ..\r\n\r\n \r\n</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,99,'Test Run','test_run','Test','','',1,2011,'Santa Barbara, Ca',NULL,NULL,0,0,'2011-10-25 00:36:38','2011-12-21 20:25:33',NULL,'<p>This is my story. We\'re trying to see if this website works. Hopefully this will come up as text, if not, there is a glitch.\r\nThis is the second paragraph, so now we\'ll see if it works or not.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(30,104,'Summer Story','summer_story','','','',1,2011,'Las Vegas',NULL,1,0,0,'2011-10-26 03:06:55','2011-12-21 20:25:33',NULL,'<p>Rollin thru tha rugged ancient terrain of new mexico well into identity tour now littering america with my manifested creative vision has been quite tha adventure a massive blur of paint parties music gas stations and glowsticks. Yet we continue pushin thru tha desert darting west in my new van or as we have been callin it hotel honda delicatly cramed with stickers custom hats poster prints giclee prints blank canvas displays cold drinks suitcases maps munchies and enuff paint to to keep tha movement moving!! Most movement run on money and paint is money it is normally said that time is money so time to paint at this point is priceless!! Sleepin on average 3 hours a night on this cannonball run of a summer tour the cities are starting to blur together 131 outside of albuquerue or however u spell that crazy city the sun is hot as fuck it was 107 in huston miami was canceled due to hurricane irrene steve aoki set disrupted and dim mak stage shut down in new jersey n new york due to extreeme weather conditions ya its been that kind of tour!!! My 6000 mile warrinty just became void a few miles ago I bought this van a few days before tour started we are covering some ground to say the least. Rollin into san diego hot we landed at tha ranch for a well needed day of rest!! Tha ranch was in its usual chaos even with no one home the good creative energy of home was all I needed after all that time on tha road! Before I new it we were packin up at cricket amp in chula vista about 10 quick mins from tha infusion ranch and headin 7 hours north to shoreline amp in the bay area!! These shows put a whole new meaning to california love!! Sean and I were welcomed with wide eyed partypeople from all walks of life young and old alike thay lust for our energy and imagery ! Trying to comprehend tha overload of color jumping out at them a few people under tha strong influence of phycotrophic mind altering substances claimed tha paint was moving on tha canvas! Anyother day this may strike one as weird but it was just another day on id tour another day another city another couple thousand people all searching for temparary stimulation thru music lights bright colors dance and drugs in no particular order at that and as much of it that one could physiclly and mentally handle!! It was obvious the zombies were out!! With all tha crazieness aside sf was one of the tours more intelligent show goers it seemd that everone had their own intellegent approch and concepts about tha art which I love! If people are using their imagination gettin emotional and making up their own story within my art than my job is done!! After tha sf throwdown we headed straight to sin city for an epic evening at the beach at mandalay bay! Showing art at greatwoods in mass jones beach in ny the beautiful painted desert of new mexico tha vintage palladium in hollywood and tha epic shoreline amp in tha bay area was in stark contrast to this rediculous hotel wave pool! mandalay bay is undenyably a vegas hotspot and to be selling art and spreading the message while enjoyin some music n cocktails with my feet in the sand was an amazing experience to say tha least!! Dressed in typical vegas fashion sean and I hit vegas with tha spirit of hunter s. thompson in our hearts strong drinks in our cups and a creative appitite for distruction on our minds!! we stagger thru tha jungle of ding ding dings cha chings and overwhelming smell of cigarettes and mounting debt only to find ourselves welcoming the sunrise like a pack of savage dogs coming home from a hunt. Where am I? Where is my room I seem to remember 26 os is it 27... things are foggy at best darkness surrounded me... is this even the right floor? I wander i stumble I wander some more my room is elusive number are jumbled reality out of touch... then I smell something that brings me back faster than the dalorian. Sweet sweet cali ! The smell is gettin stronger slowly growing into a strong funk I am close ! Like a bloodhound I sniff my way back to the closest thing I have to a home.  at this point the america is my home the road my hallway ! tha paint coverd cooler my kitchen my backyard is huge amplatheaters scatterd stratigicly like castles of old! But Instead of protecting us from foreign invaders we are shelter ourselves from the cookiecutter ideals and lithiam filled lives we lead every other day of our lives! So desperate to live we kill ourselves just to find refuge from the lives we choose !! Ah fuck finally I found my fuckin room now where the fuck is my key...... FUCK!... once again I stumble tha skinny halls of this decrepid modern pyrimid in search of the key!! Darkness returns. I sober up and get my shit tegether just in time to drop coco and schugar off at tha airport and start my migration to the final show of the tour. With a 5 day gap in between shows it was a well needed break stoppin in for a lil family time with some of rachels fam in oregon I love life on tha westcoast ! Our quick stop in ely wasn\'t quick enuff while gambleing sean and rache found out that we had gotten some counterfit money along the way what tha fuck next thing I know I\'m gettin woke up cause tha cops are fuckin wit us bout tha fake money ! If we were to make money we would probly make money that was worth something not a everdeclining 20 dolla bill! With crisis averted we pushed on tha the gorge there is no better place to end a great summer tour than the most beautiful venue in all of america the gorge nestled into tha beautiful rocky landscape of washington state the gorge is a concert goers wet dream!!  With onsite camping colorful landscapes postcard sunsets and yer favorite music filling the air its hard not to walk around with huge cheese eating grin ! I miss dj shadow he jumped off tour in texas to start up his european tour! He is a true dj artist and visionary!! Still all smiles life is good!!</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(31,104,'Summer Rant, Dig!','summer_rant_dig','','','',1,2011,'',NULL,1,0,0,'2011-10-26 03:12:59','2011-12-21 20:25:34',NULL,'<p>the tour peaked out at the gorge after 20+ cities hurricains heatwaves downpours hot sweatty ravers wet freezing raver weekend warriors adrenaline junkies the nonstop techno the I love love stickers all tha bass tha whomp whomp tha apple bowls n manufactured drugs tha glowsticks neon shirts n hats  trendy iconic backpacks candy braclets tha rockstar energy drinks n skullcandy shwag tha fans the feinds tha love tha hate  untouchable highs tha undenyable lows after the dust settles and the crowds disperse all we have is memories some art if ur lucky a few great stories 10000+ extra miles on tha honda and were off life on tha road is true freedom it is america at its finest speeding from destination to desination with a grin on our face and  the wind at our back we take this new frontier by storm taking  no prisoners mainly because there isnt room or time for ramdom rediculousness and nonescense. To hungover to drive another sec Sean rachael gwen n i rolled up to tha eastern washington mobile and camping oasis greeted by blue skies and black widows we were in for some serious r and r its good to be rollin wit sean and the fam it is a bright present and an insperation for a limitless future ! We swim eat relax and play for a few days then head towards oregon for a few shows in portland only to find ourselfs right back into it in eastern washington for the fire fest from what i can tell firefest is just an excuss for a bunch of party people to gather on tha mountain and get twistd</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(32,104,'Chubby Artist Movement and Two brothers','chubby_artist_movement_and_two_brothers','','','',1,2011,'Mojave Desert',NULL,0,0,0,'2011-10-26 03:29:31','2011-12-21 20:25:34',NULL,'<p>I hear tha road beconning me it reguires my movement without me and all the other uprooted wonderers drifters road trippers and nomads of this overpaved world the road would sit unused pointless and alone useless without a user I guess when simplified its common sence. I saw tha sign for san diego 289 miles oh man so close I can taste tha sunsoaked sands hungry for more adventure ate my left over green curry from tha thai resturant tha night before and I jammed east to tha mojave!!!!! The summer is coming to an undenyable end the leaves are turning gold brown and red tha air filled with the refreshing cool of fall insects are becoming more scarce little chubby mammals fill tha grass n trees packing on tha pounds to last tha winter. I on tha other hand am workin on a different fatty layer to survive the cold winter months with the chubby artist movement aside at this point another cold n icy chicago winter is eminant but I look fwd to the warmth of my love katie she could melt tha south pole wit her passion a scorpio at its finest and proud of it too! The infusion project expanding or relapsing back to tha midwest seemed inevitable givin schugars roots in minni n fargo and my girlfriend friends and family spread all thruout chitown it jus makes sence hopefully it makes dollars aswell.  Anyways I\'m way ahead of myself as I am currently occupying a guest room in the middle of the mojave desert a few hot miles from the everexpanding victorville. Tha homie paul has quite tha museum goin out here more commonly known as santa this old hippie has a story to tell and love to share. We have only known eachother for a short time but our friendship is truelly timeless. Accompanied by his brother bill his golden retriever and desert assasian cat malt santa has quite the euphoric setup an 800 foot well makes survival possible and is essential for life in this hot dry extreemly windy climate. With a rusted tool garden and propaine tank wind chimes this ranch was like no other and why should it be paul n bill are like no other people I have ever encounterd bill a ww2 enthousiest collector and reinactor u could oonly imagine all tha priceless tidbits of history that is compilled at this high desert meca if u allow yerself to slowly gaze over all the hand made ww2 uniforms  hundreds of street signs  posted no parking notices liscence plates warning signs realistic mock up weapons or mass creation built from old leaf blowers and spare parts old rusted gears pullies thousands of santa figurines hand made silver dollar buttons and who knows what else u start to see these brothers lives unravel right in front of u and it truelly is a beautiful living artpeace. Bill says visiting napoleons grave as a child inspired his collection and comidiclly states that \"one day he won\'t make it out of there and it (his house/museum) will be his(grave)\" haha onr of the many benifits of living a truelly free and happy life death becomes more of a joke than tha scary looming darkness like it is for most of society. The sun is hot n tha cool desert breeze  is a welcomed compliment with wind speeds reachin 110 mph nature is in full force and I can\'t seem to stay hydrated the scotch and locally crafted pale ales probly don\'t help much haha gotta love tha artlife. With a full 360 wrap around elevated deck the view from the ranch is epic and unwelcomed guests don\'t even try it well see ya comin! </p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(33,104,'Revolution','revolution','','','',1,2011,'',NULL,1,0,0,'2011-10-26 03:36:27','2011-12-28 19:21:55',NULL,'<p>with this epic summer in my rear view mirror i return to sd tired beyond words yet motivated beyond expression !!! i find america in tha mists of revolution tha \"occupy\" mentality growing stronger by tha day i have been existing in my traveling lil bubble for so long i hadnt even notice tha civil unrest yet again provin that perception is indeed reallity and im back to my reality, tha ranch in its usual creative craziness homies in from costa rica holloway back from his adventure with tha clowns of cirque du la schugar bing bonging some fresh techno or IDM for u real technerds out there tha studio was a creative mess my room even worse but its great to be home !!! now i have 3 weeks to get my shit together do some studio work a few tshirt designs some local sales and then im back to tha yellow and white outlined asphalt and concrete paths that connect this great nation. what a simultaneously wild and domestic country this u.s of a is breading large eyed freaks with tha lust to consume imbedded in their blood by tha millions constantly tryin to control tha masses with fear we search out these small bubbles of existence where we can gather in tha name of peace love and creativity untouched by tha drag of everyday life we strive to live in these bubbles forever only to find tha bubble itself is nomadic never stayin still always changing its sounds shapeshifting its looks yet always so familiar . america was built on this bubble and will continue to thrive on it forever dodging whatever oppressive factions come to burst it ! creativity will always be on the side of the people creativity is freedom oppression is a result of close minded thinking and inevitably results in the oppression of tha oppressors minds resulting in tha need for creativity and tha power comin back to the people so as tha masses gather to occupy the local town squares around the nation to fight the unbalanced system they inherited from their fathers we gather to create. we assume tha same rights as the original americans in search of that bubble that inner peace, freedom happiness, equality and community?</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(34,76,'Love is Truth','love_is_truth','','','',1,2011,'Santa Barbara',NULL,0,0,1,'2011-10-26 23:33:52','2011-12-21 20:25:35',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(36,105,'daddy\'s little girl ','daddys_little_girl_','','16','female ',1,2009,'grenada',NULL,1,1,1,'2011-10-28 00:46:07','2011-12-21 20:25:35',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(37,105,'daddy\'s little girl ','daddys_little_girl__2','','16','female ',1,2009,'grenada',NULL,1,1,0,'2011-10-28 00:46:21','2011-12-21 20:25:35',NULL,'<p>Daddy\'s little girl\'\r\n he will kill,he will run,he will died,he will fall.for daddy\'s little girl.\r\n he will not sleep or eat.he will not live or go or will he not hurt or cut because daddy\'s little girl\r\n he will showily face the world against all odds.he will work hard for my destination he will turned stone into bread because daddy\'s little girl.\r\n for i now that he knows that i will all ways be daddy\'s little girl.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(38,105,'never underestimate some one','never_underestimate_some_one','','16','female ',1,2011,'grenada',NULL,1,0,1,'2011-10-28 01:24:23','2011-12-21 20:25:36',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(39,105,'never underestimate some one','never_underestimate_some_one_2','','16','female ',1,2011,'grenada',NULL,1,0,0,'2011-10-28 01:24:28','2011-12-21 20:25:36',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(40,1,'Goblin Regatta','goblin_regatta','Bullet, j24','30','Vessel',1,2011,'Santa Barbara',NULL,0,1,1,'2011-10-31 18:13:00','2011-12-22 00:55:35',NULL,'<p><img style=\"vertical-align: top;\" src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/20/large/goblin-regatta.jpg?1320088789\" alt=\"\" /></p>\r\n<p>The weekend was filled with beautiful weather, calm seas and good breeze.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(44,125,'Climate Change And Human Rights','climate_change_and_human_rights','Global Rights','24','F',1,2011,'',NULL,1,0,1,'2011-12-18 00:41:35','2013-10-31 00:33:56','2013-10-31 00:33:56','<img src=\'http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/25/large/starving_children.jpg?1324168896\' style=\'float:left;\' /><p>Mary Robinson: Making Human Rights the Compass for All Ethical Globalization\r\n\r\n	She walks out. Her stance is professional. Her voice is soft and subtle with a skewed Irish accent. It was then that the topics “climate change” and “human rights” hit my being like a tidal wave. I felt chills and tears welling up in my ducts. “This is collective consciousness at work. Leaders are finally stepping up. It’s time to get moving”, I thought. Mary Robinson’s lecture on globalization, rights and climate change revealed truths, facts and mind-blowing realizations. Her efforts and activism thus far are out of this world. The two hours sent me on an emotional ride. The lecture affected me because Mary Robinson shed insight she gained from being physically involved and interactive around the globe. She is credible and a reliable source of information regarding the topics. It highlighted reasons why I live the life I do. The speech put into focus my life goals. I gained an informed perception of how millions of people in developing countries are affected by climate change and little to no rights. \r\n	Richard Appelbaum introduces Mary Robinson’s list of organizations that she leads. He says, “This is a rather exhausting list and makes me look like a couch potato.” Among leading the Mary Robinson Foundation, Oxfam, Women World Leaders, The Elders, she is the UN High Commissioner For Human Rights, Chair of International Institute for Environment and Development and received the Amnesty International’s Ambassador of Conscience Award. The list goes on. She began by highlighting that we need to work on solutions for seemingly unsolvable problems and that we need a world without borders. She says, “How could I not be interested in human rights? I was wedged between four brothers, two older, two younger!” She had an epiphany that human rights policies were too narrow. They focused on one point, the freedoms (i.e freedom of press, no torture, civil liberties, etc.) “Basic rights are important too”, she says.  She didn’t quite know how to turn this thought into action yet.\r\n	She felt like a “lonely voice during 9/11”. She went to ground zero to bring the perpetrators to justice because they committed a “crime against humanity”. “Saying that we have been attacked, there’s a war on terrorism sidelines human rights.” This event catalyzed her formation of the Millennium Declaration. The premise here is that globalization must work for all people. Her panel created eight goals: End poverty and hunger, create universal education, gender equality, child health, maternal health, combat HIV/Aids, environmental sustainability, and global partnership. She has done extensive work in Africa and she noticed a recurring “ah but, things have changed, things are worse because of climate change” conversation. The horn of Africa experienced its eight hottest years on record; the past eight consecutive ones. “This hugely damages and undermines human rights…Why do the poorest nations have to suffer from world’s efforts?” She wished to “put the obtuse phenomenon of this suffering into immediate focus!” Her foundation is the climate justice nexus of climate change and human rights. She has no skepticism of climate change because she claims, “I’ve seen it!” She follows with a sigh and perhaps a tear. \r\n	She tells a story of meeting five African farmers with Arch Bishop TuTu. They all claimed to not have had seasons for years. She says, “All farmers would complain of weather.” They reply, “We know. But this is way out of our experience!” She mentions, “Water stress will displace masses of people.” She then briefs the famine, water shortages and life of “climate refugees”. She places urgency on the need to act now. She was a fountain of facts and useful information.\r\n	I would go on for days explaining her deep conclusions of the world’s current state. From overlapping courses and topics, I’ve learned that we are in distress, and if people don’t feel it now, they will. This lecture affected me by filling my gaps in knowledge of climate effects and rights. It filled me in on our current state. I feel saddened that we’ve allowed this to happen, that prior generations haven’t made swifter, positive moves. However, I feel that as a whole, humans are intellectual and at times brilliant. I am hopeful and resultantly excited for what I’ll see in my lifetime as far as solutions and growth. Her news affected me because I have been thinking about such topics since being a young woman. I am emotional, an Indigo Child, of the Aquarian Age and love humanity. I sometimes feel depressed because I feel I can’t change the world. The insight I gained is that it is in mine and the world’s best interest to think about how are actions affect others on a grand scale, not just “Johnny hit sally and it hurt”. I realized the best move is to continue living my lifestyle, with hopes of being even farther off the grid. I live on a sail boat, rarely use water, shop only for food grown 50 miles maximum away (with the exception of a couple of meals). I don’t own a car, computer or I-phone by choice. I ride my bike everywhere, use a reusable bottle, biodegradable soaps, reuse paper, upcycle, pick up trash every day (5 foot radius rule) and raise my voice about the need to reduce waste and change our way of living. I feel the urgency that Robinson feels. Thank God for women like her. I had the thought in a dream that night, “she is my hero”. I feel compelled to write her a letter. She solidified my four year long dream to pursue the Peace Corps. and to start an organization, perhaps one like SOIL (composting toilets in Haiti). She revved my help engine. \r\n\r\n\r\n</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,1,'Camping at the Kern River','camping_at_the_kern_river','','','',0,2011,'Kern River, Ca',NULL,0,1,1,'2011-12-22 00:56:17','2011-12-22 00:56:17',NULL,'<p>Camping is fun!</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(47,14,'merry Xmas','merry_xmas','','','',0,2011,'Yaounde, Cameroon',NULL,1,0,1,'2011-12-25 09:14:35','2011-12-25 09:14:36',NULL,'<p>Merry Xmas to everybody!!!</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(50,128,'Stranger and MyCat','stranger_and_mycat','','','',0,2001,'Southern California',NULL,0,0,1,'2012-01-18 23:04:23','2012-04-03 02:14:54','2012-04-03 02:14:54','<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">Back in the 1980\'s I had a tour dog. I work on rocknroll shows for a living. This dog, named Stranger, would go on tour with me. He was half Samoyed, half Golden retriever, looked like a white wolf. He was welcomed at every venue we went to. He had two son\'s, Roadie and Duder, that I gave to my boss and his business partner, who were also tour dogs. &nbsp;At a lot of &nbsp;concerts they would all be there hanging out, greeting the crowd. Stranger was in a couple of documenteries on the Grateful Dead. Really beautiful animal. Really, really intelligent animal. A truly good soul.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">&nbsp;Stranger was friends with everybody. In my home town he was allowed into espresso bars, and cafes just like he was a human. He\'d travel all over town, visiting all his friends, canine and otherwise. He would bring me home beautiful women. The local dog catchers knew him and his sons and left them alone. The local butcher always had scraps for him, so he would give him a daily visit. Totally protective of little children. And really good with mentally challenged people. Very patient. He also liked to brawl with other dogs. Very Alpha male.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">When he got older, he developed cancer in his jaw. I was living with a veterinary surgical tech at the time, and she wanted to cut off his lower right jaw to keep him alive. Just \'cause you can do something, doesn\'t mean you should. He was way too proud to go through something like that. He would have had to have a feeding tube and all kinds of horrible medical madness. I wouldn\'t put him through that. He was my best friend. Then they found that the cancer had moved into his lung so they stopped hassling me to do the surgery.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">So at the same time I had a tomcat, named MyCat, that the vet tech had given me. I wasn&rsquo;t a cat person, but my girlfriend felt I should have one. I had once said that he was a beautiful cat. What she heard was \" That\'s a beautiful cat, and if it ever needs a home, I will love and cherish it\". He got his name because I would ask my friends, \"Have you met my cat\"? And they always would respond, \"You don\'t have a cat. You hate cats!\" &nbsp;Same colors as Stranger, white, dusted with gold tips. Evil cat. Huge cat. &nbsp;23 pounds. No fat. Had been a feral cat. Used as a blood donor for the vet office. If you tried to touch him you came back with a bloody stump. I owned him for seven months and never touched him. Just a cat from hell. A soulless evil cat. Never messed with Stranger, but beat up all the other dogs. 23 pounds of lean cat is a very big cat. Evil, evil cat! No soul at all.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">When Stranger let me know that he needed to die, it was the worst day of my life. We killed him on his blanket in my living room. A massive shot of phenobarbitol, then a shot of saline directly to his heart. It stopped his heart and it broke my heart. I\'ve never been the same. Leslie took his body to be cremated. I was sitting in a chair, crying my eyes out.&nbsp;</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">All of a sudden MyCat jumped into my lap. My thought was, \"Oh great. My dog is dead, and now this cat is gonna kill me\". &nbsp;But instead, he put his head on my heart, and started this massive purring.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">From that moment on, MyCat became Stranger. He\'d jump into my truck and go cruising with me. He\'d walk to the store and wait outside while I went inside. He\'d greet people in the same way Stranger did. Anyone could pick him up and play with him. He would do these elaborate tricks that I had worked out with Stranger. He was great with little kids. Very gentle. It was amazing. Everyone who knew him before Stranger\'s death was completely blown away. The only explaination we could come up with, was that as Stranger\'s soul left him, it just took over that soulless evil cat\'s body. I mean it was an instantanious transformation. And it wasn\'t because he was suddenly the only animal in the house. There were two other dogs and three cats.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">I had him for 11 more years. The whole time he just carried on in Stranger\'s footsteps. He was not a cat. He was a dog in a cat suit. He was afraid of nothing. He would sit in front of my cottage sharpening his claws, waiting for a dog. When one would charge at him, he\'d calmly hold his ground until the last second, then he would surgically remove their face. Never lost a fight. Just like Stranger. Towards the end of his life he contracted a wasting disease, and had shrunk to only 11 pounds. I couldn\'t face having to kill him, but I couldn\'t let him suffer. In his youth, as a feral cat, MyCat killed many many birds. Strangely, the only Great Horned Owl I\'ve ever seen in my hometown, started perching on the telephone pole in front of my home. He was there for over a week, watching MyCat do his daily rounds. Finally, I came home one day and MyCat was gone. I never saw&nbsp; the owl again. It was such a gift. A wild animal killed by a wild animal. I didn\'t have to make the choice.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">&nbsp;</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">Stranger died 23 years ago, and I still cry over it. MyCat died 11 years ago and I never grieved over him. I&rsquo;m at peace with it.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande;\">And by the way, Roadie and Duder lived to be 14 1/2 and died a few months apart. I was at a concert in upstate New York a decade later and a woman came up to me and asked if I was was from California. She recognized me from my home town. She wanted me to know that she had one of Stranger\'s great Granddaughters. His legacy lives on.</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande; min-height: 13.0px;\">&nbsp;</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande; min-height: 13.0px;\">&nbsp;</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande; min-height: 13.0px;\">&nbsp;</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 11.0px Lucida Grande; min-height: 13.0px;\">&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(51,141,'my story','my_story','','','',0,1998,'BiH, Gorazde',NULL,1,1,1,'2012-04-14 20:31:50','2012-05-03 01:04:11','2012-05-03 01:04:11','<p><span style=\"font-family: arial, helvetica, sans-serif;\">I was born in small town in Bosnia and Herzegovina 13 years ago (I know I\'m still young but I know a lot of about life, maybe more than some much older people). I was growing up in beautiful family. My mum and dad took so much care of me and my sister. Life was beautiful when I was 5-6, but after than everything changed. When i was 7 my father\'s buisnis was bad. My mum was houswife and she didn\'t worked anywhere. So my dad went to Germany to work. I was young and I didn\'t understand why he left, I was just sad, and I didn\'t have anyone to talk to. I know my mom was always there for me but I didn\'t know how to talk to her, how to tell her that I\'m sad because&nbsp;dad\'s not with us but he had to work to provide food for us so we can live normaly. Besides worries like that I was normal child; good in school, one of the best in my class. My father come back every several months for couple of days to be with us, to look like a normal family. While he was working in Germay economic situation was good. I had everything I needed. But I wasn\'t happy. Other kids in school were pointing fingers at me saying: \"That\'s the girl who\'s father is in Germany, she must be rich\". But I wasn\'t, I was living normaly and I didin\'t needed anything accept my dad.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">My father came back from Germay when I was 10 I think. I was so happy, may mom and sister too. We were again normal family and the economic situation was good too. My father came back to his old job. He was carpenter. We were doing just fine, and besides that we were together.&nbsp;&nbsp; &nbsp;</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">Now I\'m eight grade and I\'m excelent student, teachers say that I\'m the best student in the class. My parents are so proud of me. I train karate and I\'m blue belt, (not bad ha?). I live normal life just like kids of my ages. But my father is again in Germany, and he doesn\'t come back every couple of months, he comes back for Christmas and New year. Sometimes I hear my mum cry and that makes me sad the most. I just want her to be happy, because she\'s my beautiful mum, she gave me the wings to fly. My mum says my dad\'s gonna be in Germany until his &nbsp;<span style=\"white-space: nowrap; font-size: x-small;\">retirement.</span></span></p>\r\n<p><span style=\"font-size: x-small; white-space: nowrap; font-family: arial, helvetica, sans-serif;\">That means his probably not going to be on my graduation, hes not gonna be here at my most precious moments.</span></p>\r\n<p><span style=\"white-space: nowrap; font-size: x-small; font-family: arial, helvetica, sans-serif;\">That\'s makes me sad, but I\'m going to fight against that. I want my family back. I want to live like my friends do. </span></p>\r\n<p><span style=\"white-space: nowrap; font-size: x-small; font-family: arial, helvetica, sans-serif;\">I want to play football with my parents and sister, to go on summer holidays with them and to feel live again. </span></p>\r\n<p><span style=\"white-space: nowrap; font-size: x-small; font-family: arial, helvetica, sans-serif;\">Because I\'m only 13 year old kid. &nbsp;And I think I deserve that. &nbsp;&nbsp;</span></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(52,12,'Abalone Diving','abalone_diving','','','',0,2012,'Sonoma Coast',NULL,0,0,1,'2012-05-09 04:15:12','2012-05-09 04:15:12',NULL,'<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif; font-size: small;\"><strong>I just got back from and early morning trip Abalone diving on Norther California\'s Sonoma Coast. Those of you who have been Abalone diving know how fucking hard it is. Not like kind of hard, like you can die kind of hard. But the rewards are worth it. Let me tell you, fried abalone, a little tartar, and a cold beer... fucking magic!</strong></span></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(53,101,'Hamburglar in Florence ','hamburglar_in_florence_','','','',0,2007,'Florence, Italy',NULL,0,0,1,'2012-05-27 18:09:15','2012-06-02 20:58:00','2012-06-02 15:58:55','<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\';\">We had been in Levico for four days and it was time to head back to Tuscany. Our departure though was sad and left all of us a bit tearful when saying good-bye to Letizia. Northern Italy is beautiful; it&rsquo;s not the typical picture of Italy that most Americans imagine and this is refreshing to me. Going to Venice to see Alessandro graduate, visiting their uncle Marco in the nursing home, going to the cemetery and paying respects to family and visiting the families old neighborhood &ndash; these were all things that allowed me to really experience more of the real Italy. What I liked most about the trip was the unique opportunity to spend time with Julia and Nicole in this way and in this place. I loved living the Italian life with their family for a few short days; I could have sat at the dinner table all night just to observe and listen to everyone.<br /> <br /> We are on the train back to Tuscany and in the past four days of our trip I can tell you that we laughed so much&hellip;and we would continue to do so for the duration of their trip. Just when we thought we were &ldquo;home free&rdquo; to Tuscany without any hitches, we stopped in Florence to switch from train to bus. First, we spent 70 cents again tinkle in the public restrooms (but not before we bitched about the fact that we had to pay to do this.) Let&rsquo;s just say because of the change in our diets, all of us were having digestive problems, mainly Julia and Nicole as they were not acclimated to the Italian diet yet (food groups: pasta, gelato, wine). We had time to spare for a quick lunch before we caught the bus to Siena. The only place to eat at the train station was a McDonalds and although we all hesitated at the dreadful thought of eating McDonalds food while we were in Italy, we agreed it was okay and maybe even a good idea to get the &ldquo;pipes&rdquo; moving. Although, when I verbalized this possible constipation solution, Nicole replied, &ldquo;I refuse to pay another 70 cents to go to the bathroom again.&rdquo; I about died laughing.<br /> <br /> And honestly, I had a hankering for anything besides Italian food and a burger and fries sounded like grease made in heaven. Julia and Nicole ordered chicken sandwiches with fries and I got a burger with fries and a Coke Light. The train station was crowded and we ended up sitting on the ground, just outside the doors into the main station. I guess subconsciously I thought our day had been too easy&hellip;not enough drama apparently, because as we sat there, just starting to eat our lunch a gypsy woman started walking toward us. She was carrying a baby in a wrap around her shoulders and she was also about 5 months pregnant. Not too concerned about the situation and perhaps a bit curious as to what she would do, I only clinched my purse and told Julia and Nicole to do the same. The gypsy woman scooted closer and closer (she&rsquo;s standing and we are all sitting on the ground) and then she asked for food or money. I said no and shook my head&hellip;she continued to get closer and within milliseconds she snatched my hamburger&hellip;my greasy, American, pipe-moving, antipasta hamburger. Quite shocked, but amused we all just sat there &ndash; was this God telling me &ldquo;That will teach you to order McDonalds in Florence Italy?&rdquo; Then&hellip;instead of running away, the gypsy hamburglar ate MY lunch in front of me. Uh&hellip;excuse me? During this whole time I&rsquo;m thinking &ldquo;Should I get up and chase her for my hamburger?&rdquo; I actually visualized myself doing this &ndash; chasing after a pregnant gypsy carrying a child in one hand and a hamburger in the other hand&hellip;well, I just didn&rsquo;t think it was worth the few euros I paid. She was very, very proud of herself for such a quick snatch as she continued to stay and eat in front of me; I was pissed&hellip;then laughing&hellip;then in disbelief. Well &hellip; then me and the gypsy hamburglar decided to banter back and forth. Holding up the hamburger as though she were soluting Ronald McDonald himself, she said with a hiss, &ldquo;Grazzzzzzie&rdquo; (translation: thank you stupid American woman for the hamburger). I replied with a sarcastic &ldquo;Prego&hellip;niente&rdquo; (translation: you&rsquo;re welcome, it was nothing, is there anything else I can get for you, would you like a pie with that?). Oh ya&hellip;somewhere in all of this Nicole called her a bitch (yes, Nicole Dubiel) and I think at this point Julia is still eating her fries and observing the Italian drama that is playing out before her very eyes. Finally, the gypsy leaves us in peace&hellip;probably going to tell her fellow hamburglars her side of the story. I took a bite of Julia&rsquo;s sandwich and then a bite of Nicole&rsquo;s and then we hopped on the bus to Siena. We laughed all the way to Siena about the Gypsy Hamburglar. </span></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(54,2,'What i learned about sand','what_i_learned_about_sand','','','',0,2012,'Shelter Cove, CA',NULL,0,1,1,'2012-06-06 03:38:00','2012-06-30 17:27:57',NULL,'<p>A misty evening of car camping at Mattole beach and were about off!!&nbsp; Flat-coastal sandy beaches, a fair forecast and good friends.&nbsp; Perfect!&nbsp; Even the flowers smile in full bloom.&nbsp; Last minute check at the trailhead, packs on, and we step into the sand. Scrunch! Scrunch!&nbsp;</p>\r\n<p>Ah, this isn\'t bad, kind of molds to my foot.&nbsp; Scrunch, Scrunch! Twenty four miles, no problem.&nbsp; Scrunch, Scunch, Scunch, Scrunch. I always find hiking so peaceful.&nbsp; Free to enjoy nature and the echos in my mind, and forget everything else.&nbsp; I continue to march through the sand as the worlds pressures fades along with the sight of the truck that brought us here. &nbsp; I turn around to see the my progress.&nbsp; Eh...still see the car.&nbsp; I\'ve been going for what seems like 30 minutes.&nbsp; I\'m suddenly not so sure about this sand situation.&nbsp; Sand is my friend, sand is my friend, i tell myself.&nbsp; Twenty what miles?&nbsp; Well, keep marching.&nbsp; Scrunch, Scrunch.&nbsp; Sixty, maybe Sixty five pounds in my pack.&nbsp; Decent amount. Maybe i shouldn\'t have brought that extra book. Damn! To late now. I\'d better read some of it to make it worth it.&nbsp; Scrunch, Scrunch!&nbsp; I check my progress again.&nbsp;</p>\r\n<p>Yikes! Am i moving backwards i wonder?&nbsp; I feel like im closer than before!&nbsp; That book is gonna make a good fire starter.&nbsp; Scrunch, Scrunch! Almost to the beach, and clear of any sight of civilization.&nbsp; I\'ve lagging behind the group, better pick up the pace.&nbsp; This sand is grueling, three steps forwards, two steps back. I try to close the gap, I look ahead. Phew! Breaktime.&nbsp; I catch up, put down the pack, and grab a seat.&nbsp; I look around at my surroundings.&nbsp; Finally! No car!&nbsp;</p>\r\n<p>I look down the beach.. Twenty two miles!!&nbsp; Wow!&nbsp; In my mind i convince myself i really like hiking. Well, I actually do! Funny how that works.&nbsp; Finally someone begins to shift and the first persons get up.&nbsp; We pack up and were back on the trail.&nbsp; Scrunch, Scrunch!&nbsp;</p>\r\n<p>This is gonna be a good trip! I think..</p>\r\n<p>&nbsp;<img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/32/large/NewsletterImage3.jpg?1338952723\" alt=\"\" width=\"345\" height=\"245\" /></p>\r\n<p>And you know what, it was, but i\'m not the biggest fan of hiking on sand! Honestly I almost lost it on the Lost coast.&nbsp; Where sand is everywhere...&nbsp; Scrunch, Scrunch!</p>\r\n<p>&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,143,'Cosa?','cosa','','','',0,2012,'',NULL,1,0,1,'2012-07-30 02:26:26','2013-10-31 00:21:55','2013-10-31 00:21:55','<p>My sister is Italian. She was 7 and I was 16 when we met in northern Italy. I didn\'t really understand a word she said for the first few weeks. I had arrived at her doorstep with a smile on my face, but inside I was empty, a traumatized 16 year old foreign exchange student from California. My experience in Italy had not gone according to plan. I was confused, disappointed, and most of all simply thankful that this family had offered to give me a second chance to become part of the Italian culture I fantasized about. Learning a 2nd language had not come easily for me. Being dyslexic, I was already overly sensitive about my language skills, and unsure if it was even possible for me to learn another language. After 6 months in the country my Italian was only at a basic conversational level. I could hardly understand anything when my new little sister spoke to me. She had a high pitched voice and talked at a very fast pace. But, it didn\'t matter that our communication was limited because we enjoyed each others company. Everything she said in 7-yearold-Italian made me smile and she had a talent for deciphering my USA-Italian. From the moment we become friends my outlook on life changed for the better, like sunshine after a long cold night. I quickly learned new vocabulary and started to dream and even think in Italian. The wonderful life turning moment I became friends with my Italian little sister reminds me never to give up on a dream.</p>\r\n<p><img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/33/large/IMG_1721.JPG?1343615011\" alt=\"\" /></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(56,144,'hot chicken','hot_chicken','','','',0,2006,'Nashville, TN',NULL,NULL,0,1,'2012-07-31 18:01:07','2012-08-02 04:29:47','2012-08-02 04:29:47','<p>the week after my grandmother died, back in the fall of 2006, i caught sight of the fact that my favorite band at the time, an underground melancholy rock/americana type, was playing in nashville. Now i had been to memphis, becoming an instant elvis lover on the spot at graceland, but i never had had the pleasure of knowing her northeastern sister, nashville. just the name along evokes starstruck dreams of music contracts and honky-tonks and whiskey. plane tickets were cheap and business was slow, so i went. there was a famous rockabilly tattoo artist there i wanted to see about a swallow and i was also curious about the \"hot chicken\' I had read about in a foodie journal.....apparently it is spicy piping hot gianormous breasted fried chicken that is only served in 2 places (one of which STOLE a cook away from the 1st for the recipe!). i had to have it.</p>\r\n<p>&nbsp;</p>\r\n<p>i\'m not sure if it was a mourning destraction or a gastro-addiction, but this elusive hot chicken became my goal. As soon as the plane hit runway, i was out the door to the nearest cab, \" take me to the hot chicken\"</p>\r\n<p>\"what, you mean like KFC?\"</p>\r\n<p>\"no. the fried chicken. the best fried chicken.\"</p>\r\n<p>he ended up dropping me at cattle call bbq complex next to the convention center. thanks, buddy.</p>\r\n<p>The next day i scoured the internet and found an address, but it was way way way out further from downtown than I had imagined (not even IN nashville, but a suburb). i would need another cab, but not until after my appointment.</p>\r\n<p>&nbsp;</p>\r\n<p>\"you\'re not gonna want to eat it if you don\'t live around here.</p>\r\n<p>trust me\"..... the famous tattoo artist said to me as his gun sliced permanent color into my skin</p>\r\n<p>\"why? because you think it will do a number on my pipes?\"</p>\r\n<p>\"no. it will make you feel like you are on herion. hungover? feel like you cant find your way out of a wet paper bag? hot. chicken. fix you right up.\"</p>\r\n<p>\"why shouldnt i eat it then?\"</p>\r\n<p>\"it will ruin fried chicken for you for good\"</p>\r\n<p>I convinced him to give me the phone number that he used to get his hot chicken. you called the number, said the # of orders and went to a door in some back alley with your cash. i never went. i guess you could say i was too \"chicken\" to go underground....maybe the shoulder art had taken all my courage....</p>\r\n<p>&nbsp;</p>\r\n<p>the next day i called a cab to take me to the address i had gotten off the internet--the legitimate Prince\'s Hot Chicken!</p>\r\n<p>\"oh, you don\'t want to go to THIS address, miss\" the cab driver told me, \"its on the Wrong-side-of-town, if you know what I mean.\" The cab drivers in this town were REALLY starting to get on my nerves.</p>\r\n<p>after crosssing the bridge and 30 minutes inland, we pulled off the interstate to a strip mall, where \"prince\'s\" was painted across the windows of what looked like an old laundromat. there was a line out the door. sweet jesus! i had arrived!</p>\r\n<p>i stood in line for over an hour. with the biggest shit-eating grin ever. it was definately an old laundramat, but the machines had been ripped out and restaurant booth castoffs thrown in...the old tvs in the corners had remained for some odd reason. a wooden \'wall\' had been put up at the end and a hole cut out in it where you gave your order--hot, spicy or xtra. you got the freid chicken with 2 slices of wonderbread held on by a toothpick with 3 sweet pickle slices. the only other choice you had was chess pie or no chess pie.</p>\r\n<p>i peeked through the order hole as the person in front of me told the cashier. I saw a whole line up of old kenmore stoves, about 7 in all, ...every burner sporting an old cast iron skillet and every stove boasting a giant black man in an apron, flipping fried chicken. dogs &amp; kids were running around and women doing household chores. it was so weird. and so wonderful.</p>\r\n<p>and the chicken...</p>\r\n<p>oh.</p>\r\n<p>my.</p>\r\n<p>god.</p>\r\n<p>first of all, these were NOT natural chickens....the breasts on these babies must have been jam-packed with hormones for the pure SIZE of them! Fried so crisp it was dry, and when you pricked your litttle white plastic fork into the golden skin a puff of steam escapes the fired goodness. the meat is juicy juicy....oh my god, they say its the soaking of buttermilk. i don\'t know anything when i am eating this chicken other than pure goodness. its delicious. more than delicous. incredible.</p>\r\n<p>spicy....here\'s the weird part. I can\'t stand spicy foods--they burn my mouth and cause me much pain. but this hot chicken? that makes grown men cry? i could eat it every day for the rest of my life. Now here\'s the old wive\'s tale:</p>\r\n<p>A woman, a wonderful wife, hard-working mother and fabulous cook. Her husband? Drunk philanderin\' fool! Out boozin\' it up with the ladies of the night and not coming home until the wee hours of the morn\' demanding his fried chicken! wanting her famous fried chicken.....every night &amp; day</p>\r\n<p>until one day, she decides she\'s going to make him burn for his sins and so she starts spicing up his chicken...but soaks it in the buttermilk sose he don\'t realize the spice and then....well, and then his insides would take care of the rest.</p>\r\n<p>and it did.</p>\r\n<p>but he couldn\'t stop eating the chicken.</p>\r\n<p>and women? they naver feel the burn....they say the women of nashville can always go spicer on the hot chicken than the men.</p>\r\n<p>a curse for the cheating husband....</p>\r\n<p>and a curse for the traveling foodie, i think to myself on the plane ride home, bemoaning nashville hot chicken..... ruined on fried chicken for the rest of my life :(</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(57,146,'test','test','test','12','male',1,2012,'ahmd',NULL,0,0,0,'2012-08-24 11:48:27','2012-09-01 16:25:30',NULL,'<p>test</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(58,148,'Labor Story','labor_story','','','',0,2012,'7447 West Talcott Avenue Chicago, IL 60631',NULL,0,0,1,'2012-09-22 21:06:29','2012-09-28 00:08:19',NULL,'<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Every mother wants what&rsquo;s best for her baby. As soon as we found out we were expecting, we made sure to research ideal foods, exercises, relaxation techniques, and anything else to ensure Baby had a comfortable home during his nine-month stay. This research led us to our vision of a natural, medication-free birth for our son. We read that unnatural intervention of epidural, pain meds, and Pitocin could lead to a rushed labor or cause the mother not to feel the need to push which can put stress on the baby. Many times these interventions result in a C-Section that could have been avoided. Lastly, Grace did not want the baby to be exposed to medications in the womb that may dull and disorientate him further and affect his ability to breast feed immediately.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Once our decision of natural birth was made, we read books, watched videos and attended classes to educate our selves on the birthing process and increase our odds of a normal, natural labor and delivery.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">What is it they say about Best Laid Plans?</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">During our 41<sup>st</sup> week appointment, our OBGYN, Dr. La Barge, scheduled us for an induction of labor on August 25th. We were hesitant, as this was not in our birth plan, but we were late and Baby showed very little progress in terms of dilation and effacement (1 cm dilated, 50% effaced). It was not recommended to continue with a pregnancy past 42 weeks. &nbsp;Dr. La Barge scheduled us to come into the hospital that Saturday evening.&nbsp;Grace would be given Cervidil to help start the dilation process.&nbsp;If Sunday morning showed little progress, Grace would be given a Pitocin drip to initiate labor. If all went as planned by Dr. La Barge, baby would be born sometime on the afternoon or evening of August 26<sup>th</sup>.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">In the 5 days leading up to our induction date we tried every home technique out there to get labor started naturally. Spicy foods, foot massage, prenatal massage, miles of walking, prayer, meditation, love, etc&hellip; Whether it was one or more of our techniques or Nicholas was just ready to come out, a mere five hours before we were scheduled to be induced Grace began having steady contractions every 5-8 minutes on her own. We were thrilled! Our birth plan still had a chance!</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">We arrived at the hospital just after 7pm on the evening of Saturday, August 25<sup>th</sup>. We were introduced to the hospital staff. They were all very kind as they checked us into our delivery room. &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Over the next hour the doctors did a variety of examinations to check Grace&rsquo;s progress. Fetal heart rate and contraction monitors were strapped to her abdomen.&nbsp;All looked good. We began to settle into our room and prepare ourselves for the long labor process ahead. The mood was very relaxed, and even comical. We brought snacks and movies to get us through the long night.&nbsp;We couldn&rsquo;t help but think of this as a slumber party.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Around 8:45pm the demeanor of the nurses and doctors changed. Urgency had infiltrated their actions and words. Grace&rsquo;s contractions had become stronger and something was wrong. The nurses adjusted the strap holding her fetal heart monitor and pushed heavily on her belly during a contraction as they watched the stats on the computer screen. The resident doctor, Dr. Quinn, told us that she needed to fax a copy of the monitoring charts to Dr. La Barge and quickly left the room. Our nurse, Yvonne, informed us that the baby&rsquo;s heart rate was dropping dramatically during contractions and they didn&rsquo;t know why. His heart rate, normally hovering around 130 beats per minute, had dropped to below 80 and then below 60 during the last 3 contractions. I became fixated on the monitor and watched his heart rate blinking on screen as the next contraction came on&hellip; 135&hellip;120&hellip;100&hellip;80...60&hellip; then the numbers disappeared. An oxygen mask was placed over Grace&rsquo;s nose and mouth as tears filled her eyes. &ldquo;We need to get him out, I&rsquo;m squeezing him.&rdquo; she said.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Doctor Quinn re-entered the room with a stern look.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;Based on what we see we need to take you for an immediate Cesarean Section. Dr. La Barge is on her way to the hospital but advised us not to wait for her and to take the baby out at our discretion if necessary&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Yvonne handed Grace a form to sign as we were introduced to another nurse, Fey, who began shaving Grace&rsquo;s lower abdomen. I was handed a set of scrubs and told they would come get me if there was enough time to be with Grace during the operation. I kissed Grace and they wheeled her out of the room.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">In the last 9 months this tiny person we had never seen before had become the most important thing in our lives.&nbsp;All of the research and planning could never prepare us for this reality. For the first time we were faced with the unthinkable&hellip; leaving the hospital without a baby. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Ryan&rsquo;s Story</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I changed into my blue hospital scrubs. A nurse told me to go to the Family Waiting Room down the hall. She would come get me when they were ready. My mind raced as I paced the room. What was causing his heart rate to drop so suddenly? Was there something wrong with my Son&rsquo;s heart? Was the umbilical cord strangling him? I knew we were in the right place if this was going to happen, but that thought did little to ease my concern. The clock read 9:05pm. Through a window in the waiting room door I had a view of the staff entrance to the floor. I looked up to see Dr. La Barge come through. She walked to her left out of my sight and a minute later she quickly passed by the window again going the other way.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I couldn&rsquo;t stay in that room any longer. I stepped into the hall and walked in the direction of Dr. La Barge. I came to large sliding glass doors that said &lsquo;Authorized Personnel Only&rsquo;. A few moments later the nurse who had given me the scrubs walked up and told me I could go in now. Her keycard opened the restricted doors and she took me down the hall to an operating room door. I entered a bright white room to see Grace lying limp on a table with her eyes closed, the top of her head facing me. Her left arm was extended with an IV in her wrist. A short blue curtain was blocking the bottom half of her body. Behind the curtain I could see the top half of three people in blue scrubs with blood on their arms and chest. The room was full of people dressed head to toe in blue. They all seemed to be carrying out a different task. I quickly walked toward Grace. It didn&rsquo;t make sense to me.&nbsp;Why wasn&rsquo;t she awake? &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I was blocked by a blue man who demanded &ldquo;Who are you?!&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I was a mute.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;Are you the father?&rdquo; He said more calmly.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;Yes&rdquo; I said.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;This is General, you can&rsquo;t be in here.&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I stared blankly.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;She is under General Anesthesia, you need to leave now.&rdquo; he directed.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">The nurse seemed confused. &ldquo;I&rsquo;m sorry; I thought he could go in&rdquo;.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">As I was being backed out of the room I pleaded, &ldquo;Is he ok? Is our baby ok?&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">A nurse, who I could see was Yvonne under her mask, looked at me.&nbsp;&ldquo;Can&rsquo;t you hear him?&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">For the first time I realized that the room was filled with the sound of a crying baby.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I was escorted to a nursery where I waited for my son. Minutes that lasted hours passed before I saw nurse Fey pushing a bassinet down the hall toward me. He was wrapped in a blanket and his eyes were wide open.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;What&rsquo;s his name&rdquo; Fey asked?</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;Nicholas&rdquo; I said.</span><span style=\"font-family: Calibri; font-size: 11pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">He was the most amazing thing I had ever seen. I stayed in the nursery as Fey weighed, measured, and bathed him. I ran my hand over his tiny body and talked to him about nothing as he lay under a heating lamp. Dr. La Barge and Dr. Quinn entered, informing me the umbilical cord had been wrapped around his body multiple times&hellip;&rdquo;he was wearing it like a toga&rdquo; as Dr. La Barge described it. But he was fine. Grace was in recovery and doing great. &nbsp;We could go see mom now.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\"><br /></span></p>\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Grace&rsquo;s Story</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">My eyes poured with tears as nurses Fey and Yvonne wheeled me swiftly through the halls of Resurrection Hospital. The lights seemed to become brighter and brighter with each passing moment. I noticed my legs begin to shake uncontrollably, followed by my arms. Seconds later a stronger, longer contraction began.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">A man in full scrubs and dark eyes introduced himself as the anesthesiologist. As we made our final turn, he placed a hand on my head and said &ldquo;Dr. La Barge has decided to go with general anesthesia. We don&rsquo;t have time for a spinal. We need to get the baby out very quickly and in order to do this you must be unconscious&hellip;&rdquo; He went on to ask me questions related to my pre-pregnancy weight, what I ate earlier that day, and if I had any allergies. I hardly remember responding to any of them. <br /> <!--[endif]--></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I looked into Fey&rsquo;s eyes &ldquo;Is he going to make it? Please tell me he&rsquo;s going to be ok.&rdquo; </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">She smiled and said &ldquo;Keep breathing&rdquo; as we rushed through the security checkpoint leading to the Operating Room. &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Strong, bright fluorescents filled the gray-blue space. I heard the clatter of instruments quickly being set up on trays and tables. Two more nurses came and lifted me onto a stationary gurney. The anesthesiologist hovered over my head as he placed an oxygen mask over my face.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I felt resistance near my legs and lifted my head. &ldquo;Honey please stop shaking. I need you to be still so I can insert the catheter.&rdquo; I was the one resisting. I couldn&rsquo;t keep my body from shaking.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Soon enough, another blue-masked nurse came and strapped my arms down horizontally. Tears filled my mask. At the corner of my eye I noticed a uniformed woman speed past me toward the end of the gurney.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;I&rsquo;m here. Let&rsquo;s go.&rdquo; She turned to me as she fastened her mask, still moving toward the other end of my table. &ldquo;Sweetie, I&rsquo;m here and we&rsquo;re going to get him out.&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">It was Dr. La Barge.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I looked up at the anesthesiologist. &ldquo;When are you going to start? You&rsquo;ve got to hurry.&rdquo;&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">The contractions became more evident and incredibly painful.&nbsp;I couldn&rsquo;t help but think of my stomach muscles squeezing my helpless baby inside me. I frantically turned my head toward the monitor I was attached to, but couldn&rsquo;t read the screen.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;Everything must be perfectly timed. I cannot start until the doctors are in position. We have to time it precise so baby is not affected by the anesthesia.&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I looked down toward my feet at the team of doctors setting up. &ldquo;Please, please hurry!&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I noticed they were still attempting to put in the catheter. They had been talking to me the entire time. &ldquo;Hold still, Grace. You have to hold still&hellip;&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I looked toward the end of the room and focused my attention on a crucifix hanging on the back wall. I prayed as hard as I could, as long as I could.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">My eyes got heavy as a woman&rsquo;s voice directed the group.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;Go&rdquo;.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">What seemed like seconds later, I felt my face cupped by the anesthesiologist&rsquo;s hands. &ldquo;Here she comes.&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I jolted my head up and looked toward my feet. &nbsp;My stomach was full. I screamed at the anesthesiologist. &ldquo;The baby! You have to get the baby out! Ganesh, it didn&rsquo;t work&hellip;get the baby!&rdquo;.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">As he removed my oxygen mask, the kind man smiled and said the best words I could ever hear. &ldquo;Your baby is with his father. You did great. You both did great.&rdquo; &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Relief. Joy. Tears.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Yvonne rolled me over to recovery. She explained the cord was wrapped around my son several times.&nbsp;She told me he was healthy and very alert.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">As I waited in recovery for what seemed like hours, I couldn&rsquo;t help but ask questions.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">&ldquo;Yvonne, what was his time of birth? How much does he weigh? &nbsp;What color are his eyes? &nbsp;Is Ryan with him? &nbsp;What was his APGAR?&rdquo;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">She turned toward me with confusion. &ldquo;APGAR? You did read a lot of books. Grace, you can relax. &nbsp;He is perfect.&rdquo; &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Seconds later, Fey, Ryan, and a bassinet entered the room. My sweet, sweet baby was safe, healthy, and by far the most beautiful thing I had ever laid my eyes on. I looked at Ryan, and then back at our baby boy, Nicholas.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Fey picked the swaddled bundle up and walked toward me. &ldquo;He&rsquo;s very hungry. Would you like to feed him?&rdquo;</span><span style=\"font-family: Calibri; font-size: 11pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I nodded, slightly insecure if I would even know how to breastfeed. Fey placed Nicholas on my left side as I lowered my gown.&nbsp;Within seconds, Nicholas latched right on to me. I couldn&rsquo;t believe it! This bright-eyed baby was alert and eager to eat. It was clear he was not affected by any medication or trauma of the birth. &nbsp;&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">A few minutes later, Fey placed Nicholas back in his bassinet. She then wheeled me past labor and delivery into the post-partum unit. Ryan followed with our son, wheeling him behind us. Our room for the next four days seemed so different then any other room we experienced at the hospital. It was dimly lit, soft, and normal. It was just what we needed after what we went through.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Fey set me up with several IV&rsquo;s to help me cope with the pain. I assured her I felt fine and just needed some water. I was so thirsty. She obliged and brought back ice chips with the cup of water. She encouraged me to use the call button as often as possible, especially if I needed her to take Nicholas to the nursery. After what we went through, I couldn&rsquo;t think of any other place for him to be but right here with me. &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I spent the rest of the evening awake with Nicholas. Watching him eat, sleep, cry, and observe. I stroked his head and back, amazed at the softness of his skin. He smelled of something I&rsquo;ve never experienced.&nbsp;It was the most amazing scent. His eyes were a combination of blue and green. They were stunning. He was nothing I could ever imagine, yet everything I could ever want our son to be.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">I looked over at my exhausted, sleepy husband on the fold-out sofa. Ryan had been through far more emotional trauma than I had. He could now rest peacefully knowing our baby was safe and so was I. &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\"><br /></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\">Nicholas was born on August 25<sup>th</sup>, 2012 at 9:18pm.&nbsp;He weighed 6.2 lbs., was 19 inches long, and simply perfect. The days following his birth are by far the most magical moments we&rsquo;ve ever experienced. Although his birth was anything but normal, Nicholas has reminded us of what life is truly about. It&rsquo;s not about having a perfectly laid out plan. Life is about embracing what lies in front of you during that very moment.&nbsp;For us, it just happens to be the best thing we could ever ask for. &nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: Calibri; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: major-latin;\"><img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/35/large/100_3557.JPG?1348790863\" alt=\"\" /></span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(59,17,'Close Encounters with a Moose','close_encounters_with_a_moose','','','',0,2012,'Gustavus,AK',NULL,0,0,1,'2012-10-12 00:32:55','2012-10-12 00:32:56',NULL,'<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">I spent the day at work with a relentless urge tugging at my heart to be surrounded by the forests of Gustavus, AK. This feeling had nothing to do with the duties of work, but the comforts I found in the forest. Once again, I gathered my hiking gear, camera equipment and headed for the trailhead.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">I had intended on heading towards Bartlett Lake with the desire of finding and photographing a brown bear. I had seen many black bears the day before that were just a few miles from Bartlett Lake and thought to myself that the browns may be hanging out in the woods near the lake.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">As my feet got nearer to the trailhead, my plans dissipated and before I knew it I was on a game trail that my friend Sean had showed me earlier in the summer and not on the Bartlett Lake trail. Instead, this well-used trail began to turn from soft spongy moss to thick mud as I walked out of the forest and into a large muskeg. The game trail led me around the fringes of the muskeg. The trail became larger and well used as it tucked in and out of small dying Sitka spruce trees. The muddy trail turned from unidentifiable indentions into clearly marked moose tracks.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">My enthusiasm grew with each step, knowing that I was on the right path and that this time I was looking for a moose instead of a bear. With each step, I felt like I was getting closer to something the large animal, but I did not know that the moose would be just around the corner. The sounds the creature made were enough to stop me dead in my tracks and I suddenly remembered that a brown bear had recently taken a moose calf in the area I was now in.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">I stopped immediately on the moose trail, crouched down to look through a hole in the dense alder leaves in the direction of the sounds and was relieved to see a moose staring back at me and not a brown bear. She was peering through the same hole at me, and looked awkward with green willow leaves hanging out of her mouth. It seemed that she was just as surprised to see me, as I was she. Maybe she had also heard of the brown bear in the vicinity.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\"><a style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; color: #95091e; text-decoration: none; border-width: 0px; padding: 0px; margin: 0px;\" href=\"http://checotephotography.files.wordpress.com/2012/09/kcm-20120718-13321-edit.jpg\"><img class=\"size-full wp-image\" style=\"line-height: inherit; border-style: initial; border-color: initial; margin-top: 0.4em; max-width: 97.5%; width: auto; height: auto; border-width: 0px;\" src=\"http://checotephotography.files.wordpress.com/2012/09/kcm-20120718-13321-edit.jpg?w=1014\" alt=\"Image\" /></a></p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">My feet began to sink into the mud as I stared at this large creature. I was still on the fringes of the muskeg; the moose was eating willows on the other side of a stand of alders, and I decided to use the cover of the trees and back track a few paces and assess the situation.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">After a few minutes crouching behind the cover of alder trees, I carefully took out my camera gear. I was concerned that the noise I made would scare the moose away. With camera in hand, I crouched and crawled my way through the trees to my left trying to be as quiet as possible. I had made it about 20 feet away from the moose when I decided to double back and approach her from the cover of the trees.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">I found an over turned root system root system of a Sitka spruce tree and watched the moose behind the cover of the roots before approaching any closer. At this point, there was clear line of sight between her and I with a distance of 40 yards. I still had the perfect cover to observe and photograph without disturbing her and without her a threatening me. She was now directly in front of me casually eating and alert of her surroundings. Every couple of photographs, she would lift her head up from her grazing grounds, point one ear forwards and the other backwards and listen to the forest. I would stop photographing when she did this so that we could both listen to the sounds of the forest. We heard the chirping birds, the small steps of red tailed squirrels on trees, and the soft movements of the tiny voles underfoot. Everything sounded normal, except when my finger pressed the shutter button and the loud sound seemed to be amplified in this quiet and tranquil land.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">Every click of the shutter seemed like the loudest noise on the planet at this special moment. I could hear her chomping on her food. Her feet would sink into the mud and when she moved, it would make a suction sound as the mud formed a tight seal around her feet and my rubber boots. She grazed to the next tree aware of my presence but allowing me to be in her close proximity.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">I began feeling bold and a little more comfortable with her so crept out from the cover of my over turned root system.&nbsp; I began walking to my left while still being covered by another alder tree. The sound of my footsteps was as loud as hers because of the mud. The slower I stepped, the more my feet sank into the muck so I would stop every few steps and wait; seeing if the moose cared about my slow approach.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">Sometimes, she would lift her head and stare directly at me and I would stand as still as I could until she went back to eating.&nbsp; She would continue on her diet of willows, alder leaves, and smaller greens that grew on the marshy floor. After a few mouthfuls, I would began to take a few steps, slowly making my way to the alder tree and cautiously making my way closer to her.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">It seemed like forever, but I finally made it to the alder tree and crouched down underneath its branches. I sat there making myself as small as I could to blend in. I was in an uncomfortable position, with the mosquitoes biting at my body, my butt hovering above the water and mud, and this beautiful creature a stones throw away grazing its way through the meadow; but I remained still. I was so close, that to startle the moose from this distance could be disastrous to me.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">I was in awe of the size of this moose. Its head was easily larger than my torso and fear began to flood my brain as the moose started to slowly walk closer to where I had been hiding underneath the alder tree. It still seemed unconcerned that I was there, and was just hungrily eating all of the greenery in the area; but I was beginning to think I had made a serious mistake. She was casually eating her way towards me and all I could do was sit there and clutch my camera tightly. In between her steps, I would chance a few photographs hoping that the sound didn&rsquo;t draw her to my position.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">The moose would take a step, drop its head, take several bites, lift its head and listen to the forest again, then continue to move towards me. How long this went on I have no idea, I had left my watch and phone in the car and was glad to do so because a sudden noise could ruin this moment. Fear crept into my brain as to what would happen if this moose continued on its path towards me. I thought about the possibilities, looking over my shoulder for a quick escape route, but there was none. I had put myself in a bad spot and my legs had begun to loose feeling from being restrained in an uncomfortable squatting position for so long. I calmed my thinking and decided that there was nothing I could do but stay still and wait for the moose to finish its meal.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\"><a style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; color: #95091e; text-decoration: none; border-width: 0px; padding: 0px; margin: 0px;\" href=\"http://checotephotography.files.wordpress.com/2012/09/kcm-20120718-13385-edit.jpg\"><img class=\"size-full wp-image\" style=\"line-height: inherit; border-style: initial; border-color: initial; margin-top: 0.4em; max-width: 97.5%; width: auto; height: auto; border-width: 0px;\" src=\"http://checotephotography.files.wordpress.com/2012/09/kcm-20120718-13385-edit.jpg?w=1014\" alt=\"Image\" /></a></p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">It wasn&rsquo;t much longer, but the moose continued on the path of food and its appetite led itself away from me. She grazed over to the opposite side of the meadow where I had originally come across her. She lifted her head once more to listen to the sounds of the forest, lowered her head back down to the ground and took big mouthful of willow. Then, following a small stream began to walk away chomping on bits of greenery as she traveled in the opposite direction of me.</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">&nbsp;</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">Sincerely,</p>\r\n<p style=\"line-height: inherit; border-style: initial; border-color: initial; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; margin-top: 0px; margin-right: 0px; margin-bottom: 1.625em; margin-left: 0px; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; border-width: 0px; padding: 0px;\">Kenneth Checote Moriarty</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(60,151,'A Rocky Mountain High','a_rocky_mountain_high','','','',0,2012,'Redstone Colorado',NULL,1,0,1,'2012-11-25 00:25:11','2012-11-25 00:25:11',NULL,'<p>Greetings to all from a Rocky Mountain high. The seasons are changing and all are invited. One story road is on the map in Colorado. Stay tuned for more from another spot on the map.&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(61,152,'Facebook','facebook','Facebook','23','Male',1,2012,'Ahmedabad',NULL,1,0,0,'2012-12-03 09:01:39','2012-12-13 21:53:24',NULL,'<p><strong>Facebook</strong> is a <a title=\"Social networking service\" href=\"http://en.wikipedia.org/wiki/Social_networking_service\">social networking service</a> launched in February 2004, owned and operated by <a title=\"Facebook, Inc.\" href=\"http://en.wikipedia.org/wiki/Facebook,_Inc.\">Facebook, Inc.</a><sup id=\"cite_ref-Growth_5-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Facebook#cite_note-Growth-5\"><span>[</span>5<span>]</span></a></sup> As of September 2012, Facebook has over <a class=\"mw-redirect\" title=\"List of virtual communities with more than 100 million users\" href=\"http://en.wikipedia.org/wiki/List_of_virtual_communities_with_more_than_100_million_users\">one billion active</a> users,<sup id=\"cite_ref-6\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Facebook#cite_note-6\"><span>[</span>6<span>]</span></a></sup> more than half of them using Facebook on a <a title=\"Mobile device\" href=\"http://en.wikipedia.org/wiki/Mobile_device\">mobile device</a>.<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Facebook#cite_note-7\"><span>[</span>7<span>]</span></a></sup> Users must register before using the site, after which they may create a <a title=\"User profile\" href=\"http://en.wikipedia.org/wiki/User_profile\">personal profile</a>, add other users as <a title=\"Friending\" href=\"http://en.wikipedia.org/wiki/Friending\">friends</a>, and exchange messages, including automatic notifications when they update their profile. Additionally, users may join common-interest user groups, organized by workplace, school or college, or other characteristics, and categorize their friends into lists such as \"People From Work\" or \"Close Friends\".</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(62,153,'Wow! Gaviota  ','wow_gaviota_','','','',0,2012,'',NULL,1,0,1,'2012-12-05 03:19:23','2012-12-13 22:12:35',NULL,'<p>Wow! Such a view of my friends. &nbsp;It looks good from right here. &nbsp;Also the air smells sweet. &nbsp;Not cotton candy or kettle corn, but of lavender and bay rum. &nbsp;Well, gotta run!</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-Daisy Strudos</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/46/large/Gaviota-153664.jpg?1355436727\" alt=\"\" />&nbsp; </p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(64,153,'Yay, for Open Space!','yay_for_open_space','','','female',0,2012,'',NULL,1,0,1,'2012-12-05 04:10:12','2012-12-13 22:22:16',NULL,'<p>I am thankful for all who made it possible that Jack, i and everyone else have a place to hike, breath, to find peace and strength, amplified by a culminating beautiful coast. &nbsp;Let\'s keep protecting openspace like Gaviota and nourishing our souls with the good outdoor medicine of nature. &nbsp;I love life, I love Jack, and i love California! Happy Thanksgiving folks!</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -Erin Alvey</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ithaca,NY</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/47/large/2Gaviota-20.jpg?1355436982\" alt=\"\" />&nbsp;&nbsp;&nbsp;&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(65,153,'Thank you Gaviota!','thank_you_gaviota','','','',0,2012,'',NULL,1,0,1,'2012-12-05 05:24:41','2012-12-13 22:05:13',NULL,'<p><span style=\"font-size: medium;\">What a great end of an awesome trip through California! &nbsp;The weather and the view over the pacific are just beautiful. &nbsp;My wonderful girlfriend Carina led me up this hike and i\'m gonna kiss her for every single step it took me to get up here! &nbsp;Maybe we\'ll be back some day! In the meantime we will be happy with all the good memories at home-Austria/Europe</span></p>\r\n<p><span style=\"font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Johannes and Carina</span></p>\r\n<p><span style=\"font-size: medium;\">&nbsp; <img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/45/large/Gaviota%20117627.png?1355436225\" alt=\"\" /></span></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(66,153,'Happy New Year Gaviota Peak','happy_new_year_gaviota_peak','','','',0,2012,'',NULL,1,0,1,'2012-12-05 05:31:53','2012-12-05 05:52:06',NULL,'<p>Happy New Year and enjoy the most beautiful view in California! We made it to Gaviota Peak, were from florida visiting family and enjoyed this hike. &nbsp;We didn\'t get eaten by a Mountain Lion, but we still have the trek down to worry about...</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; -Nick Lucas, Nicole</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/39/large/2Gaviota%2010.jpg?1354686354\" alt=\"\" width=\"231\" height=\"330\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(67,153,'Made it!','made_it','','','',0,2012,'',NULL,1,0,1,'2012-12-05 05:58:32','2012-12-05 06:04:57',NULL,'<p><span style=\"font-family: verdana,geneva;\">We thought we could and we did! &nbsp;So thankful for family, friends, and our health. &nbsp;Ready for 2013 beyond my wildest dreams. &nbsp;This view is living proof of God\'s beautiful artistry. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p>\r\n<p><span style=\"font-family: verdana,geneva;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; love, peace, chicken grease-Shannon</span></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/42/large/2Gaviota%2081587.png?1354687475\" alt=\"\" /></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(68,153,'Burnt to a crisp!','burnt_to_a_crisp','','','',0,2012,'',NULL,1,0,1,'2012-12-07 02:13:11','2012-12-13 22:02:43',NULL,'<p>At one point in my life I was but a mere intern with a brand new back pack and boots. Hiking the Gaviota Coast was the ultimate adventure with my new gear. Don\'t forget to take your boots away from the fire once they\'re dry... wool socks are $20 a pair! Gaviota missions - a life of adventure.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/44/large/Gaviota-83589.jpg?1355436116\" alt=\"\" /></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(74,148,'Road Rage Coincidence','road_rage_coincidence','','','',0,2013,'Rosemont, IL',NULL,0,0,1,'2013-02-09 04:29:38','2013-02-16 20:13:58',NULL,'<p><span style=\"color: #222222; font-family: arial; font-size: small;\">&nbsp;</span><span style=\"color: #222222; font-family: arial; font-size: small;\">Yesterday as I was driving home from work I was turning off of Balmoral road on to River Road in Rosemont IL. I was making a right hand turn. There were 2 cars in front of me waiting to turn as well. There was a man crossing the street with a walk signal counting down. It was his right of way. One of the 2 cars, I could not tell which one, honked at him as he was crossing. He waved his arms in a somewhat polite manner, like \"hey I\'m just crossing the road give me a few more seconds\". The car honked again and the man threw up his arm and gave the person in the car the middle finger. One of the cars seemed to slow down but continued driving. As I watched this unfold in front of me I became very angry at the driver of the car for being so inconsiderate. It stuck with me for the rest of the evening and even into the next morning on my drive to work. It really made me upset.</span></p>\r\n<div style=\"color: #222222; font-family: arial; font-size: small;\">&nbsp;</div>\r\n<div style=\"color: #222222; font-family: arial; font-size: small;\">Today, I called my cousin on my way home from work. We are very close and had not talked in a couple months. He lives in Springfield, IL. We talked throughout my 30 min drive home. Just as we were about to hang up he began to tell me a story that he nearly got into a fight yesterday as he was coming home from work. He explained that he was walking through a crosswalk with a walk sign and a truck looking to make a right hand turn began honking at him. He said he took off his glove and gave the truck the middle finger. The truck followed him into his apartment complex and there was a continued altercation and exchange of words that began to escalate. Another car pulled in behind the truck and told my cousin that the same truck had cut her off as it was driving out of a bar parking lot. The truck finally drove off. I asked him what time yesterday it happened. He said it was between 3-4pm. The altercation I whitnessed happened around 5:30pm the same day. It may not have struck me as such a coincidence if the scene I witnessed had not made me so angry and stuck with me and if I had not talked to my cousin in months and happened to call him the next day.</div>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(75,155,'priya test','priya_test','','','',1,2013,'india',NULL,0,0,0,'2013-02-25 12:27:55','2013-03-22 15:53:46',NULL,'<p>priya test</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(77,155,'priya test 1','priya_test_1','','','',1,2013,'india',NULL,0,0,0,'2013-02-26 04:30:26','2013-03-22 15:54:14',NULL,'<p>priya test 1</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(78,155,'priya softweb test story','priya_softweb_test_story','','','',1,2013,'Mt Whitney',NULL,0,0,0,'2013-03-21 07:38:15','2013-03-22 15:53:59',NULL,'<p>priya softweb test story</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(80,2,'Why...','why','','','',NULL,2013,'santa barbara',NULL,0,0,1,'2013-12-03 05:38:14','2014-01-04 21:19:52',NULL,'<p><img style=\"vertical-align: text-top;\" src=\"http://s3.amazonaws.com/one-story-0fSDKFJeojg09j/system/srcs/55/large/OSROldman.jpg?1386048767\" alt=\"\" /></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">I\'m still rattled. &nbsp;It was nine hours ago, and it still rolls around and around my head. &nbsp;As soon as i have nothing to take my focus away my muscles tighten and eyes well up. &nbsp;I can\'t shake the thought. &nbsp;&nbsp;Is one involved with nothing more than a look? Eye contact? &nbsp;Could i have a part in this tragedy? </span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Its morning, and the sunrise is beautiful, its rays paint the clouds. &nbsp;I just returned from a trip to New York, the day before and the morning routine feels foreign. &nbsp;Its like I\'m living two lives and yet i feel great. &nbsp;I chase down some food and coffee at the grocery store, as well as, pick up a tube of toothpaste, with just enough time to get to the warehouse for the day\'s supplies. &nbsp;Takes about 15 minutes. &nbsp;Long line, but I\'m able to get my \'inside guy\' to weasel what i need without the wait. &nbsp;Just as I\'m headed out the door, my boss pulls up. &nbsp;He\'s got a job that needs taking care of, so i get the clients info and grab the supplies needed for the work. &nbsp;</span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Its only about 3 miles to the job site, but in this short drive my day takes a turn into what I can only describe as arduous or maybe it&rsquo;s, guilt? &nbsp;I take the back roads there the quickest. &nbsp;Calcicque St to a right on Voluntario St., one block down and a left on S. Canada St. &nbsp;Only to take a right back on to Calcique St. &nbsp;&nbsp;My routine is starting to refresh a bit, I\'ve gone this route so many times since the underpass was finished its mindless. &nbsp;Pulling up to S. Salinas, i slow to a stop and wait at the sign. </span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The morning traffic is heavy, people headed to work, kids with their parents going to school. &nbsp;NPR on the radio talking about the NSA. &nbsp;A truck across from me has right of way, besides the cross traffic, we make eye contact and i give him the nod to go ahead of me when he can. &nbsp;Traffic is flying. &nbsp;From the left, then the right, more from the right, then the left again. &nbsp;An Old man steps to the corner preparing to cross the busy traffic. &nbsp;Were all waiting for a break in the traffic. A driver of a pick up sees the Old man and stops before the crosswalk to let him pass. &nbsp;Both directions of cross traffic are now stopped. The truck across from me see this and looks to me, so i nod again acknowledging his right of way. He starts to pull out.</span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Mean while out of the corner of my eye i see the Old man is waving by the pickup, who is confused and in turn attempts to wave by the Old an. Who is evidently not interested in the offer proven by the wild swings of his can through the air. &nbsp;At the same time the pickup driver accepts the Old mans refusal, the truck is beginning to pull out. &nbsp;They both go at the same time, SCREECH!!! &nbsp;</span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; display: inline !important;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Luckily, the truck is pulling away from the pick up and is able to stop in time. Sittin</span><strong id=\"docs-internal-guid-64248f5f-b6e9-285d-a493-921457c8bc9b\" style=\"font-weight: normal;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">g there watching this unfold i start to wonder why the Old man didn\'t just accept the offer from the pickup driver. &nbsp;</span></strong></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The truck driver backs up as the pickup takes off. &nbsp;Maybe the old man wasn\'t in any hurry? &nbsp;The car behind the pickup has stopped and I\'m just waiting for all this to clear up as traffic starts back up. Maybe he deciding where to go for his walk? I look towards the truck thinking about why the old man refused. &nbsp;Out of the corner of my eye I see the Old man look my way and my eyes meet his. &nbsp;He\'s weathered, bent back, in his seventies maybe, with a cane and a cap. </span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">No more than a second or two after our eyes meet, the old man take a step forward while looking directly at me and WHAM!!! &nbsp;Before his foot even touches the pavement a car just appears going 35-40 mph and sends him soaring. &nbsp;I can&rsquo;t get it out of my mind. &nbsp;He was looking at me. &nbsp;Right before his head crashed into the windshield, sending him flying through the air, causing his cap, cane and shoes to go in every direction, he was looking at me... &nbsp;Why! &nbsp;I was just sitting there, thinking of nonsense, at a stop sign. &nbsp;Waiting. &nbsp;I was just waiting. &nbsp;I wasn&rsquo;t in any hurry. I just made eye contact. &nbsp;Expressionless. &nbsp;What was he thinking? &nbsp;What did he see?</span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /></strong></p>\r\n<p style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\" dir=\"ltr\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">I feel guilty...but i don&rsquo;t know why.</span></p>\r\n<p><strong id=\"docs-internal-guid-64248f5f-b6e9-285d-a493-921457c8bc9b\" style=\"font-weight: normal;\"><br /><br /></strong></p>','california','USA',NULL,NULL,NULL,NULL,NULL),(87,165,'FindingThePath','findingthepath','','','',NULL,2014,'Santa Barbara',NULL,0,0,1,'2014-07-16 20:57:59','2014-07-16 20:57:59',NULL,'<p>As a child, he was neglected and unloved. He recieved no encouragement or guidance. When he came of age and began college he was already lost and drifted away. He spent his prime years of health and strength as a vagabond. During that period of hunger and desperation he began to dream.</p>\r\n<p>&nbsp;</p>\r\n<p>Since he was a child he had known how to program and now that skill harbored the dreams of a young man. He dreamt of being rich and living well. He dreamt of owning a nice house and car and having family that loved him. But it wasn\'t money that motivated him, it was freedom. He also dreamt of freedom to travel, to savour all that life has to offer, to unfetter his heart and mind. He was torn between a dream of stability, a regular life full of Sunday BBQs and the laughter of children. A dream of simplicity and joy. And a dream of a life of creativity and freedom to explore, to go where he pleased and do as he wished. A dream to be subservient to noone but himself and always free.</p>\r\n<p>&nbsp;</p>\r\n<p>Eventually he found a residence and a job and another job and another. Another home and more jobs after that. But the jobs were pointless and the homes were temporary. Over many years his frustration grew as he toiled at meaningless work and dreamt of a better life. But when his work days were done he would go home and be too drained of energy to put more than a cursory effort into pursuing his dreams. Now, no longer a young man, just a man, the chain of short jobs and barely adequate homes broke him down. The economy collapsed and so did he.</p>\r\n<p>&nbsp;</p>\r\n<p>He gathered what supplies he could and moved to the heart of the desert. A place of tranquility and calm, a place of freedom to be oneself and do as one chooses. This place transformed him, it catalyzed him and his dreams. But eventually his poverty combined with the isolation of this place turned his freedom into another prison.</p>\r\n<p>&nbsp;</p>\r\n<p>He had begun the wheels turning though. He had started pursuing his dreams with more vigor than ever before. He began to finish his projects and deepen his skills. He left the desert with a mission to reach those dreams for once and for all. When he returned to civilization he began working harder and harder to accomplish those dreams and began having increasingly larger and larger successes along the way.</p>\r\n<p>&nbsp;</p>\r\n<p>But he was getting older, doing the work of younger men and his body and hands began to hurt all the time. The pain drove him to work harder, to push harder to fight more ferociously to become what he wanted while he still could. Further successes continued until one day he realized he had the skills to seize one of his dreams. The dream of a steady job with good pay and a stable home life was right within his grasp. He beat the streets looking for work but was denied and denied and denied again.</p>\r\n<p>&nbsp;</p>\r\n<p>He realized that his age was a cause for suspicion. He had taken to long to begin a career in this young man\'s field. His self belief was but a spider\'s thread, strong for its purpose but weak against the forces of the world. He crumpled inside. On several levels he was defeated and humbled. He gave up on his dream of stability and simple joy.</p>\r\n<p>&nbsp;</p>\r\n<p>But the vacuum was filled immediately by his other dream of freedom and personal pursuits. That dream became as a wild fire inside him. He began feverishly seeking opportunities that would allow him to live his life the way he wanted.</p>\r\n<p>&nbsp;</p>\r\n<p>His body continued to ache and creak. But still he typed, still he coded, still he dreamed.</p>\r\n<p>&nbsp;</p>','CA','United States',NULL,NULL,NULL,NULL,0);
